('IZliv4xo67c', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LklabGl2NHhvNjdj', 'Flexdashboard - Sesion 1 - 2020-08-12', 'youtube#playlistItem', 'En esta primera sesion aprenderemos sobre como diseñar dashboard utilizando la libreria de flexdashboards.', '91hS0XN8veJ9umGL3_gA4SU92Og', '2020-08-10T00:52:44Z', 0, 2, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/IZliv4xo67c\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/IZliv4xo67c'),
('Gty0tPoESxc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lkd0eTB0UG9FU3hj', 'RnoteBooks parte 2', 'youtube#playlistItem', 'En el taller pasado aprendimos como agregar diferentes elementos de diseño a nuestro notebook ahora aprenderemos a agregar codigo y correrlo. Crearemos imagenes, usaremos codigo en python, y SQL', 'n-fqTcqYMjqz06ccEr8MoJGYKB8', '2020-08-06T12:58:08Z', 192, 9, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Gty0tPoESxc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Gty0tPoESxc'),
('96niOlwgosg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Ljk2bmlPbHdnb3Nn', 'Probabilidad Condicional - Problema 77', 'youtube#playlistItem', 'Un estudio de conducta, después de un tratamiento hecho a gran número adictos a las drogas, sugiere que la probabilidad de hallarlos culpables no más de dos años después del tratamiento depende de la educación de los infractores. Las proporciones del número total de casos que caen en cuatro categorías\nde educación-culpabilidad se muestran en la tabla siguiente:\n\nSuponga que se selecciona un solo infractor del programa de tratamiento. Defi na los eventos: A: el infractor tiene 10 o más años de educación. B: el infractor es hallado culpable en no más de dos años después de terminar el tratamiento.\nEncuentre lo siguiente:\n\n\n== Tabla de contenido ==\n00:00 Recuerda suscribierte\n00:12 Lectura del problema\n01:18 Recomendaciones para la solucion del problema\n02:48 Solucion inciso a.\n03:12 (b)\n03:57 (c)\n04:45 (d)\n05:47 (e)\n06:24 (f)\n06:54 (g)\n07:23 (h)\n08:01 (i)\n08:40 Recomendaciones finales \n\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'DbGERf9iFOth3ZzJwkC9O5NsEX4', '2020-08-10T14:00:11Z', 72, 7, 1, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/96niOlwgosg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/96niOlwgosg'),
('kFRAm2f2YS4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmtGUkFtMmYyWVM0', 'Probabilidad Condicional - Problema 76', 'youtube#playlistItem', 'Una encuesta de consumidores en una comunidad particular mostró que 10% no estaban satisfechos con los trabajos de plomería realizados en sus casas. La mitad de las quejas se refería al plomero A, que realiza 40% de los trabajos de plomería de la población. Encuentre la probabilidad de que un consumidor obtenga \n\na. un trabajo de plomería no satisfactorio, dado que el plomero era A.\n\nb. un trabajo de plomería satisfactorio, dado que el plomero era A.\n\n==  Table de contenido ==\n00:00 Recuerda darle me gusta\n00:27 Lectura del problema\n01:37 Recomendacion iniciales para la solucion\n04:17 Solucion Inciso a.\n06:43 Solcuion inciso b.\n07:46 Recomendaciones finales\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'xrJ3_TaVmHEbLsPgjvEvNCPudFU', '2020-08-06T14:00:11Z', 143, 6, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/kFRAm2f2YS4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/kFRAm2f2YS4'),
('imDMLZZVACs', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmltRE1MWlpWQUNz', 'Probabilidad condicional - Problema 75', 'youtube#playlistItem', 'Se reparten cartas, una a la vez, de una baraja de 52 cartas. \n\na. Si las primeras 2 cartas son espadas, ¿cuál es la probabilidad de que las siguientes 3 cartas también sean espadas?\n\nb. Si las primeras 3 cartas son todas de espadas, ¿cuál es la probabilidad de que las 2 cartas siguientes sean también espadas?\n\nc. Si las primeras 4 cartas son todas de espadas, ¿cuál es la probabilidad de que la siguiente carta sea\ntambién una espada?\n\n=== Tabla de contenido ===\n\n00:00 Suscribete!\n00:33 Lectura problema\n01:09 Introduccion a la solucion\n02:06 Solucion inciso a.\n09:04 Solucion inciso b.\n12:06 Solucion inciso c.\n14:24 Recomendaciones finales\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'PK2PXb7cAHbV_0tgP1T9D2MiTBU', '2020-08-03T15:00:10Z', 239, 9, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/imDMLZZVACs\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/imDMLZZVACs'),
