('-TkVVs2zlsY', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Li1Ua1ZWczJ6bHNZ', 'Taller. Visualizacion de datos con GGPLOT parte 3', 'youtube#playlistItem', 'Seguimos con nuestro live sobre visualizaciones en ggplot. Aqui aprenderemos sobre otras geometrias que tenemos disponibles. Este es la ultima parte de este taller.', '5l2CdBXU3xnqEG8DgioWdJrm9oc', '2020-07-23T12:52:16Z', 234, 13, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/-TkVVs2zlsY\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/-TkVVs2zlsY'),
