('Qs1m94AmqZM', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlFzMW05NEFtcVpN', 'Manipulacion de datos con dplyr parte3', 'youtube#playlistItem', 'Seguimos con nuestro webminar sobre manipulacion de datos. En la parte 3 aprenderemos sobre joins.', 'wkfBd5RANCtomXnOELtBpMsitAA', '2020-06-25T12:52:59Z', 342, 18, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Qs1m94AmqZM\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Qs1m94AmqZM'),
('0Ve54pZest8', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjBWZTU0cFplc3Q4', 'Manipulacion de Datos con DPLYR Part 2', 'youtube#playlistItem', 'Parte 2 del taller de manipulacion de datos en dplyr. Aprenderemos a trabajar con filtros agrupados y mutates.', '5vQD2398GH5ciWniSI1yGGYFQC8', '2020-06-18T11:51:43Z', 323, 18, 1, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0Ve54pZest8\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/0Ve54pZest8'),
('QYYxoosP9u4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlFZWXhvb3NQOXU0', 'Manipulacion de datos con Dplyr en R sesion 1', 'youtube#playlistItem', 'Taller sobre manipulacion de datos utilizando la libreria dplyr. La duracion del taller sera de una hora y esta es la primera parte de una serie de 2 a 4 streams.', 'ARATUGLMoatT9YO86VsuKj9a6BM', '2020-06-11T13:12:41Z', 658, 33, 0, 0, 5, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/QYYxoosP9u4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/QYYxoosP9u4'),
('0ttBrNZ4akg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjB0dEJyTlo0YWtn', 'Taller Manipulacion de Datos', 'youtube#playlistItem', 'Estamos probando la herramienta que usaremos para llevar acabo el taller. Tambien hablaremos de los requisito necesarios para tomar el taller', 'uJI6ZF_QOZInpNeXmp7v-z_UxXg', '2020-06-05T20:41:22Z', 353, 30, 0, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0ttBrNZ4akg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/0ttBrNZ4akg'),
('EwLZW7HTlb4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkV3TFpXN0hUbGI0', 'Probabilidad Condicional - Problema  73 y 74', 'youtube#playlistItem', '# Problema 73\nGregor Mendel fue un monje que, en 1865, sugirió una teoría de la herencia basada en la ciencia de la genética. Él identifi có individuos heterocigotos para color de fl or que tenían dos alelos (un r = alelo color blanco recesivo y un R = alelo color rojo dominante). Cuando estos individuos se apareaban, se observaba que 3/4 de la descendencia tenían fl ores rojas y 1/4 tenían fl ores blancas. La tabla siguienteresume este apareamiento; cada padre da uno de sus alelos para formar el gen de la descendencia.\nSuponemos que es igualmente probable que cada padre contribuye con cualquiera de los dos alelos y que, si uno o dos de los alelos en un par es dominante (R), la descendencia tendrá fl ores rojas. ¿Cuál es la probabilidad de que un descendiente tenga \na) al menos un alelo dominante?, \nb) al menos un alelo recesivo?,\nc) un alelo recesivo, dado que la descendencia tiene fl ores rojas?\n\n# Problema 74\nCien adultos fueron entrevistados en una encuesta por teléfono. De interés fue la opinión de ellos con respecto a las cargas que implican los préstamos para estudiantes universitarios y si quienes respondieron tenían un hijo actualmente en la universidad. Sus respuestas se resumen en la tabla siguiente:\nDe los siguientes eventos, ¿cuáles son independientes? \na) A y D\n b) B y D\nc) C y D\n\n# Contenido\n0:00 Dale me gusta!\n0:37 Enunciado del problema 73\n1:57 Inciso a) problema 73\n2:42 Inciso b) problema 73\n3:15 Inciso c) problema 74\n5:53 Problema 74\n6:46 Inciso a) problema 74\n8:33 Inciso b) problema 74\n10:53 Inciso c) problema 74\n12:07 Recuerda suscribirte.\n\n# Clase de probabilidad condicional\nhttps://youtu.be/m8-MPxS06qc\n\n# Videos de teoria de probabilidades\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_pPp3J7oaUG1KtdSs6B77D\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', '9ZjqKyYgfhoE6zfascsSQe6p1XA', '2020-06-05T14:37:30Z', 474, 14, 0, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/EwLZW7HTlb4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/EwLZW7HTlb4'),
('s6oIxMjCmlQ', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnM2b0l4TWpDbWxR', 'Probabilidad Condicional - Problema 72', 'youtube#playlistItem', 'Para cierta población de empleados, el porcentaje que aprueba o reprueba un examen de competencia en un trabajo, indicado de acuerdo con el género, fueron como se ve en la tabla siguiente. Esto es, de todas las personas que tomaron el examen, 24% estaban en la categoría de hombre-aprobado, 16% estuvieron en la categoría de mujer-reprobada y así sucesivamente. Un empleado va a ser seleccionado al azar de esta población. Sea A el evento de que el empleado obtenga una califi cación de aprobado en el examen y sea M el evento de que se seleccione un hombre.\n\n# Video sobre probabilidad condicional\nhttps://youtu.be/m8-MPxS06qc\n# Clases de Estadistica \nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_pPp3J7oaUG1KtdSs6B77D\n\n# Contenido\n0:00 Recuerda Suscribirte\n0:30 Dale like\n1:08 Enunciado del problema\n2:23 Probabilidades de la tabla\n4:42 Inciso a)\n7:24 Inciso b)\n9:54 Recomendaciones Finales\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', '44y4xFJRI7Wl8UYAl2Zb_xgztP8', '2020-06-03T15:15:10Z', 448, 13, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/s6oIxMjCmlQ\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/s6oIxMjCmlQ'),
('VXKgEvZecX8', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlZYS2dFdlplY1g4', 'Probabilidad Condicional - Problema 71', 'youtube#playlistItem', '# enunciado\nSi dos eventos, A y B, son tales que P(A) = .5, P(B) = .3, y P(A ∩ B) = .1, encuentre lo siguiente: \na. P(A| B) \nb. P(B| A)\nc. P(A| A ∪B)\nd. P(A | A ∩B) \ne. P(A ∩B | A ∪B)\n\n# Video sobre probabilidad condicional\nhttps://youtu.be/m8-MPxS06qc\n\n# Lista de reproduccion de teoria de probabilidad\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_pPp3J7oaUG1KtdSs6B77D\n\n# Contenido\n0:00 Recuerda dejar un like\n1:00 Enunciado del problema\n1:35 Inciso a)\n2:54 Inciso b)\n3:48 Inciso c)\n8:17 Inciso d)\n10:48 Inciso e)\n13:24 Despedida \n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', '8_Der5ZsWhCGE-fiGjUT5Zkv_X0', '2020-06-01T14:59:44Z', 485, 32, 0, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/VXKgEvZecX8\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/VXKgEvZecX8'),
