('Jt9NUEySBx0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lkp0OU5VRXlTQngw', 'Probabilidad - Problema 67', 'youtube#playlistItem', 'Una empresa compra abastecimientos a M distribuidores y desea colocar n pedidos (n menor que M). Suponga que la empresa coloca los pedidos en forma que permita a cada distribuidor tener igual probabilidad de obtener cualquier pedido y no hay restricción en el número de pedidos que se puedan colocar con cualquier distribuidor. Encuentre la probabilidad de que un distribuidor particular, por ejemplo el distribuidor I, obtenga exactamente k pedidos (k ≤ n).\n\n Suponga que el número de distribuidores es M = 10 y que hay n = 7 pedidos por ser colocados. ¿Cuál es la probabilidad de que\n a. todos los pedidos vayan a distribuidores diferentes?,\n*b. el distribuidor I obtenga exactamente dos pedidos y el distribuidor II obtenga exactamente tres pedidos?,\n*c. los distribuidores I, II y III obtengan exactamente dos, tres y un pedido(s), respectivamente?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'M0KTnMrlRpYWRT5ifc9nmxcZwUI', '2020-05-16T22:00:11Z', 454, 12, 0, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Jt9NUEySBx0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Jt9NUEySBx0'),
('NXz_Y-DACaQ', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk5Yel9ZLURBQ2FR', 'Probabilidad - Problema 66', 'youtube#playlistItem', 'Ha surgido una disputa laboral respecto a la distribución de 20 trabajadores a cuatro trabajos de construcción diferentes. El primer trabajo (considerado muy indeseable) requirió de 6 trabajadores; el segundo, tercero y cuarto utilizaron 4, 5 y 5 trabajadores, respectivamente. La disputa surgió sobre una supuesta distribución aleatoria de los trabajadores a los trabajos que pusieron a los 4 miembros de un grupo étnico particular en el trabajo 1. Al considerar si la asignación representaba una injusticia, un panel de mediación pedía la probabilidad del evento observado. Determine el número de puntos muestrales del espacio muestral S para este experimento. Esto es, determine el número de formas en que los 20 trabajadores se pueden dividir en grupos de los tamaños apropiados para llenar todas las posiciones de trabajo. Encuentre la probabilidad del evento observado si se supone que los trabajadores son asignados en forma\naleatoria a los trabajos.\n\n¿Cuál es la probabilidad de que a el miembro de un grupo étnico sea asignado \na.  cada tipo de trabajo?,\nb.  no se asigne ningún miembro de un grupo étnico a un trabajo tipo 4?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'Su-uIX6dLZDs8tHdNOzpKHUjUZQ', '2020-05-15T14:34:13Z', 479, 7, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/NXz_Y-DACaQ\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/NXz_Y-DACaQ'),
('rzzXYeoEm1I', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnJ6elhZZW9FbTFJ', 'Probabilidad - Problemas 63, 64, 65', 'youtube#playlistItem', '# Problema 63\nLos ocho miembros del Consejo Asesor de Relaciones Humanas de Gainesville, Florida, consideró la queja de una mujer que alegaba discriminación, basada en su género, de parte de una empresa local.\nEl Consejo, compuesto de cinco mujeres y tres hombres, votó 5–3 a favor de la quejosa, con las cinco mujeres votando a favor de ella y los tres hombres en contra. El abogado que representaba a la compañía apeló la decisión del Consejo reclamando sesgo de género de parte de los miembros del Consejo. Si no hubo sesgo de género entre los miembros del Consejo, podría ser razonable hacer conjeturas de que sería probable que cualquier grupo de cinco miembros votara a favor de la quejosa como lo haría cualquier otro grupo de cinco. Si éste fuera el caso, ¿cuál es la probabilidad de que el voto se dividiera por líneas\nde género (cinco mujeres a favor, tres hombres en contra)?\n\n# Problema 64 05:04\nUn dado balanceado se tira seis veces y cada vez se registra el número de su cara superior, ¿Cuál es la probabilidad de que los números registrados sean 1, 2, 3, 4, 5 y 6 en cualquier orden?\n\n# Problema 65 07:41\nConsulte el Ejercicio 64. Suponga que el dado ha sido alterado para que las caras sean 1, 2, 3, 4, 5 y 5. Si el dado se tira cinco veces, ¿cuál es la probabilidad de que los números registrados sean 1, 2, 3, 4 y 5\nen cualquier orden?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'uemVfRuYSFT924ItO_cs-GteX94', '2020-05-13T13:52:40Z', 324, 7, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/rzzXYeoEm1I\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/rzzXYeoEm1I'),
('2HNp8TBxXtk', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjJITnA4VEJ4WHRr', 'Probabilidad - Problema 62', 'youtube#playlistItem', '# Problema 2.62 \nUn fabricante tiene nueve motores distintos en existencia, dos de los cuales llegaron de un proveedor en particular. Los motores deben dividirse entre tres líneas de producción, con tres motores pasando a cada línea. Si la asignación de motores a líneas es aleatoria, encuentre la probabilidad de que ambos motores del proveedor particular sean asignados a la primera línea.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', '69kTyn6gfsCv8b9Z0gfRkZFyI5E', '2020-05-11T16:09:28Z', 491, 14, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/2HNp8TBxXtk\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/2HNp8TBxXtk'),
('lzlOVbeth1g', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lmx6bE9WYmV0aDFn', 'Probabilidad - Problema 61 - Paradoja Cumpleaños - Parte 2', 'youtube#playlistItem', 'Suponga que preguntamos a n personas seleccionadas al azar si cumplen años el mismo día que usted.\n a Escriba una expresión para la probabilidad de que nadie comparta su cumpleaños con usted (pase por alto los años bisiestos).\n b ¿Cuántas personas es necesario seleccionar para que la probabilidad sea al menos .5 de que como mínimo una comparta cumpleaños con usted?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 't_O7O-wJfGnM6vYR62GuJh-hCUA', '2020-05-07T17:58:50Z', 454, 17, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/lzlOVbeth1g\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/lzlOVbeth1g'),
('b3ICiZlGXdc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmIzSUNpWmxHWGRj', 'Probabilidad - Problema 60 - Paradoja Cumpleaños - Parte 1', 'youtube#playlistItem', 'Considere un experimento que consiste en registrar el cumpleaños para cada una de 20 personas seleccionadas al azar. Si no se presta atención a los años bisiestos y se supone que hay sólo 365 cumpleaños distintos posibles, encuentre el número de puntos del espacio muestral S para este experimento. Si suponemos que cada uno de los posibles conjuntos de cumpleaños es igualmente probable, ¿cuál es la probabilidad de que cada persona de las 20 tenga un cum-\npleaños diferente?\n\n Suponga que registramos el nacimiento para cada una de las n personas seleccionadas al azar.\na Escriba una expresión para la probabilidad de que ninguna comparta el mismo cumpleaños. \nb ¿Cuál es el valor más pequeño de n para que la probabilidad sea al menos .5 de que como mínimo dos\npersonas comparten el mismo cumpleaños?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'UOxf7tGp3BDsw-miRlDz1p6Go-k', '2020-05-05T14:28:01Z', 426, 14, 0, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/b3ICiZlGXdc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/b3ICiZlGXdc'),
('yspwVnChwOQ', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnlzcHdWbkNod09R', 'Probabilidad -  Ejercicio 59', 'youtube#playlistItem', '#problema 59#\nSe reparten cinco cartas de una baraja de 52 cartas.  ¿Cuál es la probabilidad de sacar \na. 1 as, 1 dos, 1 tres, 1 cuatro y 1 cinco (esta es una forma de obtener una “escalera”)?,\nb. cualquier escalera?\n\nProblemas de probabilidad capitulo 2 libro estadistica matematica\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'BqaEhSsPjt0GMREW-nolUylfCVw', '2020-05-03T23:34:22Z', 654, 22, 0, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/yspwVnChwOQ\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/yspwVnChwOQ'),
('ae_JpNzrATU', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmFlX0pwTnpyQVRV', 'Probabilidad - ejercicios 54 al 58', 'youtube#playlistItem', 'Enunciados de cada problema asi como en donde aparecen en el video,\n\n## Problema 54  00:00\nHay un grupo de tres pasantes y cinco estudiantes egresados para ocupar ciertos puestos gubernamentales para estudiantes. Si cuatro estudiantes se han de seleccionar al azar de entre este grupo, encuentre la probabilidad de que exactamente dos pasantes se encuentren entre los cuatro seleccionados.\n\n##Problema 55 04:22\nSe ha de realizar un estudio en un hospital para determinar las actitudes de los enfermeros hacia diversos procedimientos administrativos. Se ha de seleccionar una muestra de 10 enfermeros de entre un total de 90 enfermeros empleadas por el hospital.\na. ¿Cuántas muestras diferentes de 10 enfermeros se pueden seleccionar?\nb. Veinte de los 90 enfermeros son hombres. Si 10 enfermeros se seleccionan al azar entre los empleados por el hospital, ¿cuál es la probabilidad de que la muestra de diez incluirá exactamente 4 hombres (y 6 mujeres) enfermeros?\n\n## Problema 56 08:13\nUna estudiante se prepara para un examen estudiando una lista de diez problemas. Ella puede resolver seis de ellos. Para el examen, el profesor selecciona cinco problemas al azar de los diez de la lista dada a los estudiantes. ¿Cuál es la probabilidad de que la estudiante pueda resolver los cinco problemas del\nexamen?\n\n##Problema 57 11:25\nSe sacan dos cartas de una baraja estándar de 52 cartas. ¿Cuál es la probabilidad de obtener un as y una figura?\n\n##Problema 58 14:26\nSe reparten cinco cartas de una baraja de 52 cartas. ¿Cuál es la probabilidad de sacar\na. 3 ases y 2 reyes?,\nb. un “full” (tres cartas de una clase, 2 cartas de otra clase)?\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'NdgvG86npmCI1QOreY3FPodoxVY', '2019-10-25T14:17:16Z', 2447, 31, 0, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ae_JpNzrATU\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ae_JpNzrATU'),
('TdReXOj88j4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlRkUmVYT2o4OGo0', 'probabilidad - ejercicios 52 y 53', 'youtube#playlistItem', '## Ejercicio 52\nUn experimentador desea investigar el efecto de tres variables: presión, temperatura y tipo de catalizador en el rendimiento de un proceso de refi nación. Si el experimentador trata de usar tres ajustes, cada uno para temperatura y presión y dos tipos de catalizadores, ¿cuántas series experimentales tendrán que ejecutarse si él desea realizar todas las posibles combinaciones de presión, temperatura y tipos de catalizadores?\n\n## Ejercicio 53\nCinco compañías, F1, F2, … , F5, ofrecen cotizaciones para tres contratos separados C1, C2 y C3. A\ncualquiera de las fi rmas se le otorgará un contrato a lo sumo. Los contratos son muy diferentes, de modo que una asignación de C1 a F1, por ejemplo, debe ser distinta de una asignación de C2 a F1.\na ¿Cuántos puntos muestrales hay en total en este experimento que involucra la asignación de contratos\na las fi rmas? (No es necesario indicarlos todos.)\nb Dada la suposición de puntos muestrales igualmente probables, encuentre la probabilidad de que a F3 se le conceda un contrato.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'elPp5BBw461wuT2ao-9qvtONcEk', '2019-10-17T14:18:50Z', 881, 7, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/TdReXOj88j4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/TdReXOj88j4'),
('Ae7Ql0eKu64', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkFlN1FsMGVLdTY0', 'Probabilidad - ejercicios 50 y 51', 'youtube#playlistItem', '## problema 50\nLa probabilidad desempeñó un papel en la manipulación de la lotería del estado de Pennsylvania del 24 de abril de 1980 (Los Angeles Times, 8 de septiembre de 1980). Para determinar cada uno de los dígitos del número ganador de tres dígitos, cada uno de los números 0, 1, 2,..., 9 se coloca en una pelota de ping‒pong, las diez pelotas se agitan con aire en un compartimento y el número seleccionado para el dígito es el de la bola que flota a la parte superior de la máquina. Para alterar las probabilidades, los conspiradores inyectaron un líquido en todas las bolas empleadas en el juego excepto las que tenían los números 4 y 6, haciendo casi seguro que las bolas más livianas fueran seleccionadas y determinar los dígitos del número ganador. Luego compraron billetes de lotería con los potenciales números ganadores. ¿Cuántos números ganadores potenciales hubo (al final 666 fue el ganador)?\n\n## Problema 51\nUna fraternidad local está realizando una rifa en la que se han de vender 50 boletos, uno por cliente. Hay tres premios para ser concedidos. Si los cuatro organizadores de la rifa compran un boleto cada uno, ¿cuál es la probabilidad de que los cuatro organizadores ganen\na. todos los premios?,\nb. exactamente dos de los premios?,\nc. exactamente uno de los premios?,\nd. ninguno de los premios?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'D9HYX3Fr7toGTdP120T1o3I6ujk', '2019-10-15T23:45:38Z', 2058, 14, 0, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Ae7Ql0eKu64\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Ae7Ql0eKu64'),
('hVkucvXz1dc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmhWa3Vjdlh6MWRj', 'Probabilidad - ejercicios 48 y 49', 'youtube#playlistItem', '## Problema 48\nSi deseamos expandir (x + y)^8, ¿cuál es el coeficiente de x^5y^3? ¿Cuál es el coeficiente de x^3y^5?\n## Problema 49\nLos estudiantes que asisten a clase en la Universidad de Florida pueden seleccionar de entre 130 disciplinas de posgrado. El posgrado de un estudiante se identifica en los registros del secretario general de\nla universidad con un código de dos o tres letras (por ejemplo, los posgrados en estadística se identifican con STA, los de matemáticas con MS). Algunos estudiantes optan por dos posgrados y completan los\nrequisitos para ambos antes de graduarse. Al secretario general se le pidió considere asignar a estos dos posgrados un código diferente de dos o tres letras para que puedan ser identificados en el sistema de\nregistro del estudiante.\n\na. ¿Cuál es el número máximo de posibles posgrados dobles disponibles para estudiantes de la Universidad de Florida?\n\nb. Si existe cualquier código de dos o tres letras para identificar posgrados individuales o dobles, ¿de cuántos códigos de posgrado se dispone?\n\nc. ¿Cuántos códigos de posgrado se requieren para identificar estudiantes que tienen ya sea un posgrado individual o uno doble?\n\nd. ¿Hay sufi cientes códigos de posgrado para identifi car todos los posgrados individuales o dobles en la Universidad de Florida?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'nRFZpJ9ZqQJQPIo-Jovf2-Vh4lk', '2019-10-14T19:15:10Z', 427, 6, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/hVkucvXz1dc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/hVkucvXz1dc'),
('R-QOTvvI6Iw', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlItUU9UdnZJNkl3', 'Probabilidad - ejercicios 46 y 47', 'youtube#playlistItem', '## Problema 46\nDiez equipos están jugando en un torneo de baloncesto. En la primera ronda, a los equipos se les asignan al azar los juegos 1, 2, 3, 4 y 5. ¿En cuántas formas pueden ser asignados los equipos a los juegos?\n\n## Problema 47\nConsulte el Ejercicio.46. Si 2n equipos van a ser asignados a los juegos 1, 2, … , n, ¿en cuántas formaspueden ser asignados los equipos a los juegos?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'oBUWGBMmpx1kjl4h2oS7-A94Hs4', '2019-10-14T14:00:10Z', 781, 14, 0, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/R-QOTvvI6Iw\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/R-QOTvvI6Iw'),
('Ue1WZM6VNiA', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlVlMVdaTTZWTmlB', 'probabilidad - Ejercicio 45', 'youtube#playlistItem', 'Ejercicio 45 capitulo 2 mendenhall estadistica matematica\nSuponga que deseamos expandir (x + y + z)17. ¿Cuál es el coefi ciente de x2y5z10?\n\n## Lista con todos los videos de probabilidad\nhttps://www.youtube.com/watch?v=1kg565G4rZg&list=PLAFn9q_BCao9Jg4qk6bfh5D_eqmZRDHFr\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'a1qy4Bavp0K99DTZ2AMg2ywVcM0', '2019-10-11T05:00:30Z', 646, 14, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Ue1WZM6VNiA\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Ue1WZM6VNiA'),
('tMQXJnv8SAg', NULL, 'probabilidad - ejercicio 41, 42, 43, 44', NULL, 'problema 41\n\n¿Cuántos números telefónicos diferentes de siete dígitos se pueden formar si el primer dígito no puede ser cero?\n\nproblema 42\nLa directora de personal de una corporación ha contratado diez nuevos ingenieros. Si tres puestos de trabajo (muy distintos) se abren en una planta en Cleveland, ¿en cuántas formas puede ella ocupar los puertos?\n\nproblema 43\nUna flota de nueve taxis se ha de despachar a tres aeropuertos en forma tal que tres vayan al aeropuerto A, cinco al aeropuerto B y uno al aeropuerto C. ¿En cuántas formas distintas se puede lograr esto?\n\nproblema 44\nConsulte el Ejercicio 43. Suponga que los taxis son asignados a aeropuertos al azar.\na Si exactamente uno de los taxis necesita reparación, ¿cuál es la probabilidad de que sea despachado\nal aeropuerto C?\nb Si exactamente tres de los taxis necesitan reparación,¿cuál es la probabilidad de que cada aeropuerto reciba uno de los taxis que necesita reparación?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', NULL, NULL, 4889, 48, 5, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/tMQXJnv8SAg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/tMQXJnv8SAg'),
('KLDTS8gwBXo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnRNUVhKbnY4U0Fn', 'probabilidad - ejercicio 38, 39, 40, 41', 'youtube#playlistItem', 'p38\nUn restaurante de nivel económico alto ofrece un menú especial de precios  jos en el que, por un costo  jo de comidas, una persona puede seleccionar de entre cuatro aperitivos, tres ensaladas, cuatro entradas y cinco postres. ¿Cuántas comidas diferentes hay si una de ellas consta de un aperitivo, una ensalada, una entrada y un postre?\n\np39\nUn experimento consiste en tirar un par de dados.\na Use los teoremas combinatorios para determinar el número de puntos muestrales del espacio\nmuestral S.\nb Encuentre la probabilidad de que la suma de los números que aparezcan en el dado sea igual a 7.\n\np40\nUna marca de automóvil viene en cinco estilos diferentes, con cuatro tipos de motor, con dos tipos de\ntransmisiones y en ocho colores.\na ¿Cuántos autos tendría que tener en existencia un distribuidor si incluyera uno por cada combinación de estilo, motor y transmisión?\nb ¿Cuántos tendría que tener en existencia un centro de distribución si todos los colores de autos se tuvieran para cada combinación del inciso a?\n\np41\n¿Cuántos números telefónicos diferentes de siete dígitos se pueden formar si el primer dígito no puede ser cero?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', '2mdNo6UFeIBsAQWCa3FTRIMzjvI', '2018-08-14T21:40:24Z', 12505, 63, 7, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/KLDTS8gwBXo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/KLDTS8gwBXo'),
('kko-GoSJxNQ', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LktMRFRTOGd3Qlhv', 'probabilidad - Ejercicios 35 al 37', 'youtube#playlistItem', 'problema 35\nUna línea aérea tiene seis vuelos de Nueva York a California y siete vuelos de California a Hawai diarios. Si los vuelos se han de hacer en días separados, ¿cuántos arreglos diferentes de vuelos puede ofrecer la línea aérea de Nueva York a Hawai?\n\nProblema 36  02:00\nUna operación de ensamble en una planta de manufactura requiere tres pasos que se pueden realizar en cualquier secuencia. ¿En cuántas formas diferentes se puede efectuar el ensamble?\n\nproblema 37 03:38\nUna mujer de negocios de Filadel a está preparando su itinerario para una visita a seis ciudades impor- tantes. La distancia recorrida y por tanto el costo del viaje, dependerá del orden en que ella planee su ruta.\na ¿Cuántos itinerarios diferentes (y costos de viaje) son posibles?\nb Si la mujer selecciona al azar uno de los posibles itinerarios y Denver y San Francisco son dos de las\nciudades que ella piensa visitar, ¿cuál es la probabilidad de que visite Denver antes de San Francisco?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '7dpVZl0hgwSEsq3XC73GV2Wm8jo', '2018-07-25T15:22:53Z', 3996, 33, 3, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/kko-GoSJxNQ\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/kko-GoSJxNQ'),
('ETybic7Z4Yw', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lmtrby1Hb1NKeE5R', 'probabilidad - ejercicio 34', 'youtube#playlistItem', 'Los pacientes que llegan a una clínica para atención externa pueden seleccionar una de tres estaciones de servicio. Suponga que los médicos se asignan al azar a las estaciones y que los pacientes por tanto no tienen preferencia de estación. Tres pacientes llegan a la clínica y se observa su selección de estación.\na Indique los puntos muestrales para el experimento.\nb Sea A el evento de que cada estación recibe a un paciente. Indique los puntos muestrales en A.\nc Haga una asignación razonable de probabilidades a los puntos muestrales y encuentre P(A).\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'uoNlHzc01E7A_tNpEtq_2TfGfc8', '2018-06-22T16:21:41Z', 1718, 14, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ETybic7Z4Yw\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ETybic7Z4Yw'),
('CfhfzkmYOMM', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkVUeWJpYzdaNFl3', 'probabilidad - ejercicio 31', 'youtube#playlistItem', 'Un furgón de ferrocarril contiene seis sistemas electrónicos complejos. Dos de los seis se han de selec- cionar al azar para hacerles pruebas completas y luego clasi carlos como defectuosos o no defectuo- sos.\na Si dos de los seis sistemas en realidad están defectuosos, encuentre la probabilidad de que al menos\nuno de los dos sistemas probados sea defectuoso. Encuentre la probabilidad de que ambos sean de-\nfectuosos.\nb Si cuatro de los seis sistemas están defectuosos en realidad, encuentre las probabilidades indicadas\nen el inciso a.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'lDSYtGyug_H6UEI-ULUMTS5m9Ms', '2018-07-04T16:06:22Z', 2818, 61, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/CfhfzkmYOMM\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/CfhfzkmYOMM'),
('U2k3_wXAWZs', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkNmaGZ6a21ZT01N', 'probabilidad - problema 32', 'youtube#playlistItem', 'Un detallista vende sólo dos estilos de consolas estéreo y la experiencia muestra que ambas tienen igual\ndemanda. Cuatro clientes en sucesión entran a la tienda para comprar estéreos. El vendedor está intere- sado en sus preferencias.\na Indique las posibilidades para arreglos de preferencia entre los cuatro clientes (esto es, indique el\nespacio muestral).\nb Asigne probabilidades a los puntos muestrales.\nc Denote con A el evento de que los cuatro clientes pre eran el mismo estilo. Encuentre P(A).\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'TVgAM6GuSPiUAhC0XkNzomMn5ts', '2018-06-26T15:52:08Z', 1057, 22, 1, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/U2k3_wXAWZs\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/U2k3_wXAWZs'),
('ZfID7BiL-Go', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlUyazNfd1hBV1pz', 'probabilidad - ejercicio 33', 'youtube#playlistItem', 'La Oficina del Censo reporta que el ingreso familiar mediano para todas las familias en Estados Unidos, durante el año 2003, fue $43,318. Esto es, la mitad de todas las familias estadounidenses tuvo ingresos que rebasaban esta cantidad y la mitad tuvo ingresos iguales o menores a esta cantidad. Suponga que se hace una encuesta a cuatro familias y que cada una de ellas revela si su ingreso rebasó los $43,318 en 2003.\na Indique los puntos del espacio muestral.\nb Identi que los eventos simples en cada uno de los eventos siguientes:\nA: al menos dos tuvieron ingresos de más de $43,318.\nB: exactamente dos tuvieron ingresos de más de $43,318.\nC: exactamente una tuvo ingresos menores o iguales a $43,318.\nc Haga uso de la interpretación dada para la mediana para asignar probabilidades a los eventos simples y encuentre P(A), P(B) y P(C).\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'NuRhnCodR0osEueaozyTQ1J3anQ', '2018-06-26T21:13:49Z', 1336, 11, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ZfID7BiL-Go\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ZfID7BiL-Go');
INSERT INTO `videos` (`video_id`, `id`, `title`, `kind`, `description`, `etag`, `published_at`, `views`, `likes`, `dislikes`, `favorites`, `comments`, `iframe`, `link`) VALUES
('bNr_W6Rh9eI', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlpmSUQ3QmlMLUdv', 'probabilidad - ejercicios 25 y 26', 'youtube#playlistItem', 'Ejercicio 25\nAl azar se selecciona un solo auto de entre todos los registrados en una agencia local de placas. ¿Qué piensa usted de la siguiente frase? “Todos los autos son marca Volkswagen o no lo son. Por tanto, la probabilidad de que el auto seleccionado sea un Volkswagen es de 1/2.”\n\nEjercicio 26\nSegún el Webster’s New Collegiate Dictionary, una varilla adivinadora es “una barra en forma de hor- queta que se piensa indica (o adivina) la presencia de agua o minerales al inclinarse hacia abajo cuando se mantiene sobre una veta”. Para probar el dicho de un experto en varillas adivinadoras, unos escépticos entierran cuatro latas en el suelo, dos vacías y dos llenas de agua. El experto es llevado a las cuatro latas y se le dice que dos de ellas contienen agua. Él usa la varilla adivinadora para probar cada una de las cuatro latas y decide cuáles de ellas contienen agua.\na Indique el espacio muestral para este experimento.\nb Si la varilla adivinadora es totalmente inútil para localizar agua, ¿cuál es la probabilidad de que el\nexperto identi que en forma correcta (por adivinación) las dos latas que contienen agua?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'Vh0N1RwtlhY_-rhcEHL4hdBeDRg', '2018-07-02T15:11:33Z', 1592, 15, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/bNr_W6Rh9eI\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/bNr_W6Rh9eI'),
('2rF4BlQaJ1Y', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmJOcl9XNlJoOWVJ', 'probabilidad - Ejercicio 27', 'youtube#playlistItem', 'En el Ejercicio 12 consideramos una situación en la que unos autos entran a un crucero y podría cada uno de ellos dar vuelta a la derecha, a la izquierda o seguir de frente. Un experimento consiste en observar dos vehículos que pasan por el crucero.\na ¿Cuántos puntos muestrales hay en el espacio muestral? Indíquelos.\nb Suponiendo que todos los puntos muestrales sean igualmente probables, ¿cuál es la probabilidad de\nque al menos un auto dé vuelta a la izquierda?\nc De nuevo suponiendo puntos muestrales igualmente probables, ¿cuál es la probabilidad de que a lo\nsumo un vehículo dé vuelta?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'sa5NG5H6-c6iwJ6bX3UlaWUGeV0', '2018-06-15T15:37:05Z', 2619, 21, 1, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/2rF4BlQaJ1Y\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/2rF4BlQaJ1Y'),
('NfpqGtHBVeE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjJyRjRCbFFhSjFZ', 'probabilidad - ejercicio 28', 'youtube#playlistItem', 'Cuatro personas igualmente calificadas hacen solicitud para ocupar dos puestos idénticos en una empresa. Un y sólo un solicitante es miembro de un grupo de minoría étnica. Los puestos se llenan al seleccionar dos de los solicitantes al azar.\na Indique los posibles resultados para este experimento.\nb Asigne probabilidades razonables a los puntos muestrales.\nc Encuentre la probabilidad de que el solicitante del grupo étnico minoritario sea seleccionado para una posición.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '3RWu9rFzjMfkt_eWwFKWsMXcnVw', '2018-06-15T19:55:42Z', 1330, 15, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/NfpqGtHBVeE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/NfpqGtHBVeE'),
('vVH_-Jp0Yb0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk5mcHFHdEhCVmVF', 'probabilidad - Ejercicio 29', 'youtube#playlistItem', 'Se necesitan dos jurados adicionales para completar un jurado para un juicio criminal. Hay seis jurados en perspectiva, dos mujeres y cuatro hombres. Dos de los jurados son seleccionados al azar de entre los seis disponibles.\na De na el experimento y describa un punto muestral. Suponga que es necesario describir sólo los dos\njurados seleccionados y no el orden en el que fueron elejidos.\nb Indique el espacio muestral asociado con este experimento.\nc ¿Cuál es la probabilidad de que los dos jurados seleccionados sean mujeres?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'TlA_F4vOo49NH32lXa2dFvjGdwk', '2018-06-18T15:29:36Z', 3352, 23, 1, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/vVH_-Jp0Yb0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/vVH_-Jp0Yb0'),
('3YmQGs3lC18', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnZWSF8tSnAwWWIw', 'probabilidad - ejercicio 30', 'youtube#playlistItem', 'Tres vinos importados van a ser clasi cados de menos a más por un experto en vinos. Esto es, un vino será identi cado como el mejor, otro como el segundo mejor y el vino restante como el peor.\na Describa un punto muestral para este experimento.\nb Indique el espacio muestral.\nc Suponga que el “experto” no sabe en realidad nada de vinos y que al azar asigna el lugar a los tres vinos. Uno de los vinos es de mucha mejor calidad que los otros. ¿Cuál es la probabilidad de que el experto no clasi que el mejor vino como peor que el segundo mejor?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '3UlIG4vX0c9uj5cSIy1QONGewoE', '2018-06-19T15:52:41Z', 1263, 23, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/3YmQGs3lC18\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/3YmQGs3lC18'),
('N7VsSnZQEPE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjNZbVFHczNsQzE4', 'Probabilidad - ejercicios 9, 10 y 11', 'youtube#playlistItem', 'Ejercicio 9\nEl tipo de sangre de todas las personas es A, B, AB u O. Además, cada persona tiene también el factor Rhesus (Rh) (+) o (–). Un técnico médico registra el tipo de sangre de una persona y el factor Rh. Indique el espacio muestral para este experimento.\n\nEjercicio 10\nLas proporciones de fenotipos sanguíneos A, B, AB y O, en la población de todos los caucásicos en Estados Unidos son aproximadamente .41, .10, .04 y .45, respectivamente. Un solo caucásico se selec- ciona al azar de la población.\na Indique el espacio muestral para este experimento.\nb Hagausodelainformacióndadaantesparaasignarprobabilidadesacadaunodeloseventossim-\nples.\nc ¿Cuál es la probabilidad de que la persona seleccionada al azar tenga tipo de sangre A o tipo AB?\n\nEjercicio 11\nUn espacio muestral está formado por cinco eventos simples, E1, E2, E3, E4 y E5.\na Si P(E1) = P(E2) = 0.15, P(E3) = 0.4 y P(E4) = 2P(E5), halle las probabilidades de E4 y E5.\nb SiP(E1)=3P(E2)=0.3,encuentrelasprobabilidadesdeloseventossimplesrestantessisesabeque son igualmente probables.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '9FQqayoaYWEV26Iq6j4Uummmq5Y', '2018-06-20T15:29:19Z', 10974, 41, 2, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/N7VsSnZQEPE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/N7VsSnZQEPE'),
('H1Yfg6WTOek', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk43VnNTblpRRVBF', 'Probabilidad - Ejercicio 12', 'youtube#playlistItem', 'Un vehículo que llega a un crucero puede dar vuelta a la derecha, a la izquierda o continuar de frente. El experimento consiste en observar el movimiento de un solo vehículo por el crucero.\na Indique el espacio muestral para este experimento.\nb Suponiendo que todos los puntos muestrales son igualmente probables, encuentre la probabilidad de\nque el vehículo dé vuelta.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'dsUbOPLck3Dt3cVBAsPt5of_3ks', '2018-06-07T16:16:29Z', 2441, 7, 1, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/H1Yfg6WTOek\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/H1Yfg6WTOek'),
('EDuzZb0_lAM', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkgxWWZnNldUT2Vr', 'Probabilidad - Ejercicio 13', 'youtube#playlistItem', 'Los estadounidenses pueden ser bastante suspicaces, en especial cuando se trata de conspiraciones del gobierno. Sobre la pregunta de si la Fuerza Aérea de Estados Unidos tiene oculta la prueba de la existen- cia de vida inteligente en otros planetas, las proporciones de estadounidenses con opiniones que varían se dan en la tabla.\n\n____________________________\nOpinión                Proporción\n____________________________\nMuy probable          .24 \nPoco probable         .24 \nImprobable               .40 \nOtra                            .12\n__________________________\n\nSuponga que se selecciona un estadounidense y que se registra su opinión.\na ¿Cuáles son los eventos simples para este experimento?\nb Todosloseventossimplesqueusteddioenelincisoa,¿sonigualmenteprobables?Sinoesasí,¿cuá-\nles son las probabilidades que deben asignarse a cada uno?\nc ¿Cuál es la probabilidad de que la persona seleccionada encuentre al menos un poco probable que la\nFuerza Aérea esté ocultando información acerca de vida inteligente en otros planetas?\n\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'SH7saGRk4lmrRtRcg6bGVmdGRO8', '2018-06-07T18:02:08Z', 1609, 7, 0, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/EDuzZb0_lAM\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/EDuzZb0_lAM'),
('7_XQNpLGh1A', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkVEdXpaYjBfbEFN', 'Probabilidad - Ejercicio 14', 'youtube#playlistItem', 'Una encuesta clasi có a gran número de adultos de acuerdo con si se les diagnosticó la necesidad de usar lentes para corregir su visión de lectura o si ya usan lentes cuando leen. Las proporciones que caen\nen las cuatro categorías resultantes se dan en la tabla siguiente:\n_____________________________________________\n                                            Usa lentes para leer\n                                   __________________________\nNecesita Lentes                     Si              No\n______________________________________________\n\nSi                                              0.44         0.14\nNo                                            0.02          0.40\n______________________________________________\n\nSi se selecciona un solo adulto del grupo grande, encuentre las probabilidades de los eventos de nidas a continuación. El adulto\na necesita lentes,\nb necesita lentes pero no los usa,\nc usa lentes los necesite o no.\n \n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '8-3M0l5Q06UucjCu7DbnxFmuq0k', '2018-06-07T21:19:01Z', 2850, 23, 2, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/7_XQNpLGh1A\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/7_XQNpLGh1A'),
('acsNzez2Un0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjdfWFFOcExHaDFB', 'Probabilidad - Ejercicio 15', 'youtube#playlistItem', 'Una empresa de exploración petrolera encuentra petróleo o gas en 10% de sus perforaciones. Si la em- presa perfora dos pozos, los cuatro posibles eventos simples y tres de sus probabilidades asociadas se dan en la tabla siguiente. Encuentre la probabilidad de que la compañía encuentre petróleo o gas\n\na. en la primera perforación pero no en la segunda,\nb.  en al menos una de las dos perforaciones.\n\n____________________________________________________________________\nEvento          Resultado de la                 Resultado de la                   Prob\nSimple       Primera perforacion             Segunda Perforacion\n____________________________________________________________________\nE1             Encuentra                                Encuentra                             0.01\nE2             Encuentra                                No Encuentra                        ?\nE3             No Encuentra                          Encuentra                             0.09\nE4             No Encuentra                         No  Encuentra                       0.81\n____________________________________________________________________\n\n\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'goVvGPqxyktC6okHl6BMIIngovo', '2018-06-08T17:14:52Z', 5263, 27, 0, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/acsNzez2Un0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/acsNzez2Un0'),
('L0JTo2n2aHE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmFjc056ZXoyVW4w', 'Probabilidad - Ejercicio 16', 'youtube#playlistItem', 'De los voluntarios que entran en un centro de sangre, 1 en 3 tienen sangre O+, 1 en 15 tienen O–, 1 en 3 tienen A+ y 1 en 16 tienen A–. El nombre de una persona que previamente ha donado sangre se selecciona de los registros del centro. ¿Cuál es la probabilidad de que la persona seleccionada tenga \na. tipo de sangre O+?\nb. tipo de sangre O?\nc. tipo de sangre A?\nd. ni tipo A ni tipo O de sangre?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'nudFQfI5p7dhlXwIn1ty_zfHvK8', '2018-06-08T20:45:20Z', 2219, 14, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/L0JTo2n2aHE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/L0JTo2n2aHE'),
('ke7u9Lkylls', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkwwSlRvMm4yYUhF', 'probabilidad - Ejercicio 17', 'youtube#playlistItem', 'Los trenes de aterrizaje hidráulicos que salen de una planta de reparación de aviones se inspeccionan para ver si tienen defectos. Registros históricos indican que 8% tienen defectos sólo en ejes, 6% tienen defectos sólo en bujes y 2% tienen defectos en ejes y bujes. Uno de los trenes hidráulicos se selecciona al azar. ¿Cuál es la probabilidad de que el conjunto tenga\na un buje defectuoso?\nb un eje o buje defectuoso?\nc exactamente uno de los dos tipos de defecto?\nd ningún tipo de defecto?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '7Qqk5ngReehtw91XWzXkq-hodk4', '2018-06-11T15:45:00Z', 3845, 28, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ke7u9Lkylls\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ke7u9Lkylls'),
('7gBXtZEJIq0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmtlN3U5TGt5bGxz', 'probabilidad - ejercicio 18', 'youtube#playlistItem', 'Suponga que dos monedas balanceadas se tiran al aire y que se observan las caras superiores.\na Indique los puntos muestrales para este experimento.\nb Asigne una probabilidad razonable a cada punto muestral. (¿Los puntos muestrales son igualmente\nprobables?)\nc Denote con A el evento de que exactamente se vea una cara y con B el evento de que se vea al menos\nuna cara. Indique los puntos muestrales en A y B.\nd De su respuesta al inciso c, encuentre P(A), P(B), P(A ∩B), P(A ∪B) y P(A ∪B).\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'wO7X2X4npOuGBlgWebTiBqOCxXA', '2018-06-11T21:26:14Z', 4380, 34, 2, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/7gBXtZEJIq0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/7gBXtZEJIq0'),
('daTA1qBI_Jw', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjdnQlh0WkVKSXEw', 'probabilidad - Ejercicio 19', 'youtube#playlistItem', 'Una oficina de  finanzas solicita suministros de papel de uno de tres vendedores, V1, V2 o V3. Los pedidos han de colocarse en dos días sucesivos, un pedido por día. Así, (V2, V3) podría denotar que el vendedor V2 obtiene el pedido en el primer día y el vendedor V3 obtiene el pedido en el segundo día.\na Indique los puntos muestrales en este experimento de solicitar papel en dos días sucesivos.\nb Suponga que los vendedores se seleccionan al azar cada día y se asigna probabilidad a cada punto\nmuestral.\nc Denote con A el evento de que el mismo vendedor obtenga ambos pedidos y B el evento de que V2\nobtenga al menos un pedido. Encuentre P(A), P(B), P(A ∪ B) y P(A ∩ B) al suponer las probabilidades de los puntos muestrales en estos eventos.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'HoRw4YIo6SUdGgjGpuEg1Qs7_dE', '2018-06-12T15:51:13Z', 1855, 17, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/daTA1qBI_Jw\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/daTA1qBI_Jw'),
('Aczryp_vm6s', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmRhVEExcUJJX0p3', 'probabilidad - Ejercicio 20 - Problema de Monty Hall', 'youtube#playlistItem', 'El siguiente juego se jugó en un conocido programa de televisión. El presentador mostró tres cortinas\ngrandes a una concursante. Detrás de una de las cortinas estaba un bonito premio (quizá un auto nuevo) y detrás de las otras dos cortinas había premios sin valor (falsos). A la concursante se le pidió escogiera una cortina. Si las cortinas eran identi cadas por sus premios, podrían estar marcadas G, D1 y D2 (buen premio, falso1 y falso2). Entonces, el espacio muestral para la selección de los concursantes es S = {G, D1, D2}.\n a.\nSi la concursante no tiene idea de cuáles cortinas ocultan los premios y selecciona una cortina al azar, asigne probabilidades razonables a los eventos sencillos y calcule la probabilidad de que la concursante seleccione la cortina que oculta el premio bueno.\nb.\nAntes de mostrar a la concursante lo que estaba detrás de la cortina inicialmente escogida, el pre- sentador del juego abriría una de las cortinas y mostraría a la concursante uno de los premios sin valor (siempre podría hacer esto porque sabe cuál cortina oculta el premio bueno). Luego ofreció a la concursante la opción de cambiar de la cortina inicialmente seleccionada a la otra cortina restante no abierta. ¿Cuál estrategia lleva al máximo la probabilidad que tiene la concursante de ganar el premio bueno: quedarse con la opción inicial o cambiar a la otra cortina? Al contestar la siguiente secuencia\nde preguntas, usted descubrirá que, quizá de una manera sorprendente, esta pregunta puede ser con- testada si se considera sólo el espacio muestral citado antes y usar las probabilidades que asignó para contestar el inciso a.\ni Si la concursante escoge quedarse con su selección inicial, gana el premio bueno si y sólo si inicialmente escogió la cortina G. Si se queda con su selección inicial, ¿cuál es la probabilidad de que gane el premio bueno?\nii\n Si el presentador le muestra uno de los premios sin valor y ella cambia a la otra cortina sin abrir, ¿cuál será el resultado si inicialmente ella hubiera seleccionado G?\niii \nConteste la pregunta del inciso ii si ella inicialmente seleccionó uno de los premios sin valor.\niv \nSi la concursante cambia su selección inicial (como resultado de haberle sido mostrado uno de\nlos premios sin valor), ¿cuál es la probabilidad de que la concursante gane el premio bueno?\nv \n¿Cuál estrategia lleva al máximo la probabilidad de la concursante de ganar el premio bueno: quedarse con su selección inicial o cambiar a la otra cortina?\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'JFLjd1nZKbsuFA3DHzH3IdpLIlM', '2018-06-12T21:23:37Z', 2294, 38, 0, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Aczryp_vm6s\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Aczryp_vm6s'),
('PSqvjPyeoxg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkFjenJ5cF92bTZz', 'probabilidad - Ejercicio 21 al 24', 'youtube#playlistItem', 'Ejercicio 21\nSi A y B son eventos, use el resultado obtenido en el Ejercicio 2.5(a) y los axiomas de la De nición 2.6 para demostrar que\nP(A) = P(A ∩B) + P(A ∩B).\n\nEjercicio 22\nSi A y B son eventos y B ⊂ A, use el resultado obtenido en el Ejercicio 2.5(b) y los axiomas de la\nDe nición 2.6 para demostrar que\nP(A) = P(B) + P(A ∩B).\n\nejercicio 23\nSi A y B son eventos y B ⊂ A, ¿por qué es “obvio” que P(B) ≤ P(A)?\n\nEjercicio 24\nUse el resultado del Ejercicio 22 y los axiomas de la Definición 6 para demostrar el resultado “obvio” del Ejercicio 23.\n\n\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'AJKU9PqAEC1PtBc7hV7Gl1EE1Yg', '2018-06-13T21:31:34Z', 1353, 16, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/PSqvjPyeoxg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/PSqvjPyeoxg'),
('LS39oJtK1GU', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlBTcXZqUHllb3hn', 'Probabilidad - Repaso Conjuntos - Ejercicio 7 y 8', 'youtube#playlistItem', 'ej7\nUn grupo de cinco solicitantes para un par de trabajos idénticos está formado por tres hombres y dos\nmujeres. El empleador ha de seleccionar dos de los cinco solicitantes para los trabajos. Denote con S el conjunto de todos los resultados posibles para la selección del empleador. Denote con A al subconjunto de resultados correspondientes a la selección de dos hombres y con B al subconjunto correspondiente a la selección de al menos una mujer. Indique los resultados en A, B, A ∪ B, A ∩ B y A ∩ B. Denote los hombres y mujeres diferentes con M1, M2, M3 y W1, W2, respectivamente.)\n\nej8\nDe una encuesta de 60 estudiantes que asisten a clase en una universidad, se encontró que 9 vivían fuera del campus, 36 eran pasantes y 3 eran pasantes que vivían fuera del campus. Encuentre el número de estos estudiantes que\na eran pasantes, vivían fuera del campus o ambos.\nb eran pasantes que vivían en el campus.\nc eran graduados que vivían en el campus.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'vGKnTNLlpA7ezDeJ6kLDMit8f8k', '2018-06-14T20:16:01Z', 2602, 24, 0, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/LS39oJtK1GU\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/LS39oJtK1GU'),
('oXYZA4btTdc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkxTMzlvSnRLMUdV', 'Probabilidad - Repaso Conjuntos - Ejercicio 6', 'youtube#playlistItem', 'Suponga que se tiran dos dados y que se observan los números de las caras superiores. Denotemos con S el conjunto de todos los pares posibles que se pueden observar. [Estos pares se pueden indicar, por ejemplo, si con (2, 3) se denota que un 2 se ha observado en el primer dado y un 3 en el segundo.]\na De na los siguientes subconjuntos de S:\nA: el número en el segundo dado es par. B: la suma de los dos números es par. C: al menos un número del par es impar.\nb Indique los puntos en A, C, A ∩B, A ∩B, A ∪B y A ∩C.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'A9C1aNeu3hialhK512S-yWo4yfg', '2018-06-06T14:56:07Z', 2272, 22, 2, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/oXYZA4btTdc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/oXYZA4btTdc'),
('YBPakMhx5Qo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lm9YWVpBNGJ0VGRj', 'Probabilidad - Repaso Conjuntos - Ejercicio 4 y 5', 'youtube#playlistItem', 'ej 4\nSi A y B son dos conjuntos, dibuje diagramas de Venn para veri car lo siguiente:\na A = (A ∩B) ∪(A ∩B).\nb Si B ⊂ A entonces A = B ∪( A ∩ B).\n\nej 5\nConsulte el Ejercicio 4. Use las identidades A = A ∩ S y S = B ∪ B y una ley distributiva para de-\nmostrar que\na A=(A∩B)∪(A∩B).\nb SiB⊂AentoncesA=B∪(A∩B).\nc Además, demuestre que (A ∩B) y (A ∩B) son mutuamente excluyentes y que, por tanto, A es la\nunión de dos conjuntos mutuamente excluyentes, ( A ∩ B ) y ( A ∩ B )\nd TambiéndemuestrequeBy(A∩B)sonmutuamenteexcluyentesy,siB⊂A,Aeslaunióndedos\nconjuntos mutuamente excluyentes, B y ( A ∩ B).\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'lDb8RrnxnK56_R6bBgz_FV31CB8', '2018-06-06T14:56:06Z', 1487, 14, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/YBPakMhx5Qo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/YBPakMhx5Qo'),
('fD_QMlJz9u4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LllCUGFrTWh4NVFv', 'Probabilidad - Repaso Conjuntos - Ejercicio 2 y 3', 'youtube#playlistItem', 'eje 2\nSuponga que A y B son dos eventos. Escriba las expresiones que contengan uniones, intersecciones y complementos que describan lo siguiente:\na Ocurren ambos eventos.\nb Al menos uno ocurre.\nc Ninguno ocurre.\nd Exactamente uno ocurre.\n \nej3\nTrace diagramas de Venn para veri car las leyes de DeMorgan. Esto es, para dos conjuntos cualesquiera AyB,(A∪B)= A∩By(A∩B)=A∪B.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'RPQnPqZEhxf0sidlNYadgWmmAa4', '2018-06-06T14:56:07Z', 4459, 34, 5, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/fD_QMlJz9u4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/fD_QMlJz9u4'),
('1kg565G4rZg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmZEX1FNbEp6OXU0', 'Probabilidad - Repaso Conjuntos - Ejercicio 1', 'youtube#playlistItem', 'Suponga que una familia contiene dos hijos de edades diferentes y estamos interesados en el género de estos niños. Denotemos con F que una hija es mujer y M que el hijo es hombre y denote con un par, por ejemplo F M, que el hijo de mayor edad es la niña y el más joven es el niño. Hay cuatro puntos en el conjunto S de posibles observaciones:\nS = {FF, FM, MF, MM}.\nDenote con A el subconjunto de posibilidades que no contenga hombres; B, el subconjunto que con- tiene dos hombres; y C, el subconjunto que contenga al menos un hombre. Indique los elementos de A, B, C, A ∩ B, A ∪ B, A ∩ C, A ∪ C, B ∩ C, B ∪ C y C ∩ B.\n\nEjercicio 2.1 del libro de estadistica matematica con apllicaciones de wackerly - Mendenhall - Scheaffer\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'tMRd7_B-7qp7_HQACnlCW1zjm_M', '2018-06-06T14:56:07Z', 4447, 41, 1, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/1kg565G4rZg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/1kg565G4rZg'),
