('FHKMcoWk150', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Ljd3QmVYdzRoSUVn', 'Visualisaciones con caret -  Visualizando patrones en la Data.', 'youtube#playlistItem', 'Con este video aprendera como hacer visualizaciones para modelos de apredizaje supervisado de regresion y clasificacion. Utilizaremos la libreria de CARET la cual es muy utilizada para agilizar el proceso de creacion de modelos.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'rewhHMpaoio2f_y4WUY090GSDX0', '2018-05-16T14:49:13Z', 424, 7, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/FHKMcoWk150\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/FHKMcoWk150'),
('2EsaQPJzoeo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkZIS01jb1drMTUw', 'Dilema Varianza Sesgo (Varianze Bias Tradeoff )', 'youtube#playlistItem', 'Aprenderemos cual es el dilema de la varianza y el sesgo cuando uno hace aprendizaje estadístico (Inteligencia Artificial, Aprendizaje de Maquina).  \n\nTambién aprenderás cuando estamos en un caso donde hay sobre ajusto (Overfit) o de mal ajuste (Underfit). \n\nPara entender mejor este concepto usaremos R para hacer ilustrar esta idea con un ejemplo practico.\n\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '1VYBKoy12Q-u5UEpLG0yo8HLx-A', '2018-05-14T15:51:41Z', 1362, 27, 1, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/2EsaQPJzoeo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/2EsaQPJzoeo'),
