('cfbgN7tAla0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk5Odm5iYzdPZjJV', 'Markov y el Quijote. Generando oraciones basadas en el quijote y sus frecuencias.', 'youtube#playlistItem', 'En este video utilizaremos los bigramas para generar oraciones a partir de la maxima frecuencia de los bigramas del libro del quijote.\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'XM6JYMIuISUEjxTg-N5hXiLs8cA', '2018-04-13T13:58:01Z', 307, 6, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cfbgN7tAla0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/cfbgN7tAla0'),
('ENO0mr97NVw', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmNmYmdON3RBbGEw', 'Mineria de texto, el Quijote y Markov - Parte 3 - Creación de la red de palabras', 'youtube#playlistItem', 'En esta tercera parte de nuestos videos sobre Markov y El quijote. Aprenderemos como crear una red de asociación de palabras. Esta red es la contrucción de la cadena de Markov que despues utilizaremos para crear oraciones aleatorias.\n\nNo olvides suscribirte al canal.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestro sitio===\n\nhttp://www.academatica.com', 'QeMkP2s8fIb3PyxZ7vd_SsWwp3Y', '2018-04-10T13:46:09Z', 541, 9, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ENO0mr97NVw\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ENO0mr97NVw'),
('pVEFutXgplc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkVOTzBtcjk3TlZ3', 'Mineria de texto, el Quijote y Markov - Parte 2 - Creacion de bigramas', 'youtube#playlistItem', 'Parte 2 de la serie de aplicaciones de las cadenas de Markov. Siguiendo con el analisis por medio de text mining (mineria de texto) del libro del quijote, aprenderemos como crear bigramas los cuales usaremos despues para crear la cadena de markov del quijote y asi generar texto aleatorio.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'G9kKsworAAtjx-b_efHljAkhw-4', '2018-03-22T12:48:25Z', 1056, 14, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/pVEFutXgplc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/pVEFutXgplc'),
('DMEB-OnKW5A', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnBWRUZ1dFhncGxj', 'Usando Text Mining para analizar el Quijote - Parte 1', 'youtube#playlistItem', 'Este es el primer video de mi clase de aplicaciones de cadenas de markov. En el cual uso tecnicas de text mining para constuir un grafo de las palabar que aparecen en el quijote. \n\nEl tutorial esta creado en el lenguaje de programación R y el ide Rstudio.\n\nEn este primer video de la serie aprenderemos como cargar un libro y como remover espacios en blanco, puntuaciones y otros filtros comunes.\n\nhttps://www.dropbox.com/s/o6t72jr9ctpu129/quijote.txt?dl=0\nhttp://rpubs.com/chzelada/368112\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.academatica.com', 'SPI_yYQwyapcw4Gprv9oMeq1-8U', '2018-03-14T12:42:46Z', 1492, 30, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/DMEB-OnKW5A\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/DMEB-OnKW5A'),
