('p-2I-fra7og', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlZFWTk5dF9kVHZn', 'Comparación de modelos con CARET (Audio no funciona)', 'youtube#playlistItem', 'Despues de crear varios modelos verificando su habilidad predictora como comparamos que modelos usar o cual es el mejor. En este video explico como utilizar la libreria CARET para hacer esto. \n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'OVmkE7Xd9J8bcCWAAuMQJr32Y14', '2017-06-19T16:02:49Z', 143, 1, 0, 0, 5, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/p-2I-fra7og\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/p-2I-fra7og'),
('rATHtWg816U', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnAtMkktZnJhN29n', 'Transformacion de la data y el metodo de BoxCox Libreria CARET R   ReShapping Data', 'youtube#playlistItem', 'Algunas veces la relación lineal entro dos variables no es evidente o es necesario llevar a acabo algun tipo de transformación para linearizar su relacion. En este video explico como hacer usando la libreria caret del lenguaje de programaci\'on R\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'BZE3NMgZUf3gLasg-GsXe8SSBms', '2017-06-19T15:33:21Z', 890, 6, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/rATHtWg816U\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/rATHtWg816U'),
('VoR9wHHMbqE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnJBVEh0V2c4MTZV', 'Centrado y escalado con CARET   Preprocesado de datos', 'youtube#playlistItem', 'Muchos algortimos de preduccion necesitans que la data este centrada y escalada para tener un mejor performance. Aqui explico como lleva a cabo el centrado y escalada de data utilizando la libreria de caret en el leguaje R.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '2gvGGuB3oMYjTp7tNp9gvvl-HGQ', '2017-06-16T16:48:49Z', 503, 5, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/VoR9wHHMbqE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/VoR9wHHMbqE'),
('4R3eLkgr_Mo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlZvUjl3SEhNYnFF', 'Imputación de datos con CARET  Prepocesado', 'youtube#playlistItem', 'En este video explico como imputar datos. La imputación es el proceso por mediante el cual removemos los datos faltantes de un data set. El solo eliminarlos no es buena practica se deben sustituir por algun valor. En este video presento dos metodos de imputacion el KNN y el de Mediana.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '1To672TBS5I1vmeSZOlUXmUGwaY', '2017-06-16T16:43:20Z', 808, 8, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/4R3eLkgr_Mo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/4R3eLkgr_Mo'),
('1d1IX91xcJo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjRSM2VMa2dyX01v', 'Usando la función train de caret para entrenar un regresion logistica', 'youtube#playlistItem', 'En el siguiente video exploco como utilizar la función train de la libreria caret para entrenar una regresión logistica. Tambien aprenderemos como utilizar todos los procesadores de la maquina en R con la libreria doMC\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'xJduW_Qd-7vlqRbJR2ZexCWf92A', '2017-06-13T16:07:57Z', 642, 12, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/1d1IX91xcJo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/1d1IX91xcJo');
INSERT INTO `videos` (`video_id`, `id`, `title`, `kind`, `description`, `etag`, `published_at`, `views`, `likes`, `dislikes`, `favorites`, `comments`, `iframe`, `link`) VALUES
('2rn0KiAKMZg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjFkMUlYOTF4Y0pv', 'Train y Test Split, Matriz de Confusion y Curva ROC con Caret', 'youtube#playlistItem', 'En este video explicamos como utilizar la libreria caret para separar un conjunto de datos en el dataset de entrenamiento y el de prueba. Tambien explicamos como hacer la matris de confusion y graficar la curva ROC usando CARET\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'FOA6ZmNQ480oOjeua6_N9v2ggXs', '2017-06-13T15:36:20Z', 1001, 9, 2, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/2rn0KiAKMZg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/2rn0KiAKMZg'),
('DIhnaOfbDz0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjJybjBLaUFLTVpn', 'Cross Validation con la libreria Caret', 'youtube#playlistItem', 'En este video explico como haver el cross validation para el entrenamiento de una modelos utilizando la libreria caret.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'UFFX1UJTe9JsCMkT5eiVL_-FDa4', '2017-06-12T15:33:00Z', 1739, 18, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/DIhnaOfbDz0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/DIhnaOfbDz0'),
('Qv_hDaSAttk', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkRJaG5hT2ZiRHow', 'Introducción Shiny Apps', 'youtube#playlistItem', 'En este video doy una introducción a shiny apps. Herramienta de Rstudio que permite cread dashboard interactivos y poderlos poner en internet.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '6jU-oJPkkbkuFxzOsxOwtwSm_eM', '2017-06-07T00:25:35Z', 6429, 102, 3, 0, 13, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Qv_hDaSAttk\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Qv_hDaSAttk'),
('GlzA1aekBmg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlF2X2hEYVNBdHRr', 'Clasificacion con data desbalanceada. Down Sampling.', 'youtube#playlistItem', 'En este video enseño como usar la tecnica de Down Sampling para balancear datasets que no estan balanceados o que tiene una alta cantidad de observaciones negativas comparadas con las positivas. Utilizamos una regresion logista y una matriz de confusión para verificar el mejoramiento en el performance de la predicción.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'eq7PV2NPt0WEX9c1kJOe_S0RSuo', '2017-06-05T15:58:23Z', 1134, 16, 1, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/GlzA1aekBmg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/GlzA1aekBmg'),
('FB5oDSWRefU', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkdsekExYWVrQm1n', 'Introducción a la libreria CARET', 'youtube#playlistItem', 'Este es el primer video sobre como usar la famosa libreria de machine learning de R llamada Caret por la siglas en ingles ( Classification And REgression Training). El documento utilizado en este video los puedes encontrar en \n\nhttp://rpubs.com/chzelada/279724\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '_FTq38Kjdrt02wcroPGdrLuptNc', '2017-05-30T22:48:11Z', 1281, 18, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/FB5oDSWRefU\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/FB5oDSWRefU'),
('fzZBpgm22PI', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkZCNW9EU1dSZWZV', 'Curva ROC y el AUC', 'youtube#playlistItem', 'En este video explico como leer una curva ROC y como usar el AUC para medir el performance de un modelo.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'IcElIjurpInsGztQwKtU23-v0w4', '2017-05-30T15:24:47Z', 7968, 69, 2, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/fzZBpgm22PI\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/fzZBpgm22PI'),
('0T8iHwGu1p4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmZ6WkJwZ20yMlBJ', 'Evalución de Clasificadore. Curva ROC (Receiver Operating Characteristic)', 'youtube#playlistItem', 'En la Teoría de detección de señales una curva ROC (acrónimo de Receiver Operating Characteristic, o Característica Operativa del Receptor) es una representación gráfica de la sensibilidad frente a la especificidad para un sistema clasificador binario según se varía el umbral de discriminación.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '61W2P3nmcwUguXz45lJWATLt2HY', '2017-05-23T17:31:46Z', 2146, 14, 3, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0T8iHwGu1p4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/0T8iHwGu1p4'),
('fHdXQYNQnlE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjBUOGlId0d1MXA0', 'Matriz de confusion, ejemplo para modelar la deteccion de fraude en tarjeta de credito', 'youtube#playlistItem', 'En este video enseño como construir la matriz de confusion para el modelo de detección de fraude en tarjeta de credito visto en los videos anteriores. Enseño como modificar el performance basado en cambios en el cutoff de la clasificación.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'UWB69lJ7Ig2HAw6s_ZEIDUd560c', '2017-05-22T13:45:05Z', 4587, 35, 1, 0, 5, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/fHdXQYNQnlE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/fHdXQYNQnlE'),
('MKDNmW_ckjE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmZIZFhRWU5RbmxF', 'Matriz de confusión para evaluación de un modelo de clasificación', 'youtube#playlistItem', 'En el siguiente video explico que es una matriz de confusión. Tambien explico que información podemos estraer de ella para medir o evaluar la calidad de un modelo de clasificación.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'pRljpKoJ9ffby7J8iLq1JymNohQ', '2017-05-16T01:29:04Z', 13165, 99, 5, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/MKDNmW_ckjE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/MKDNmW_ckjE'),
('hX6llK2mA3c', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk1LRE5tV19ja2pF', 'Clasificación por discriminante linea en R usando la funcion lda()', 'youtube#playlistItem', 'En este video explico como utilizas R para hacer una clasificación de discriminante lineal usando la función lda() de la librería MASS. También explico cada uno de los parámetros que devuelve esta función.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'BofhNl7hidxQhX-BLZ9XLCx0TjE', '2017-05-15T16:00:03Z', 2616, 18, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/hX6llK2mA3c\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/hX6llK2mA3c'),
