('Fp8HpRnKkPc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmN0WjRWV3NTa3VN', 'Regresión Logística Introducción Razón de Posibilidades (Odds)', 'youtube#playlistItem', 'En este video introduzco el concepto de Razón de Posibilidades (Odds Ratio) La cual creo que es la mejor traducción del ingles al español. Este concepto sentara la base para podes entender como es una regresión logística.\n \n* El documento usado en la serie de videos sobre regresión logística http://rpubs.com/chzelada/273621\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'luLR4OM0Bezf4529xaN_dJlxDg8', '2017-05-07T04:24:25Z', 1145, 6, 8, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Fp8HpRnKkPc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Fp8HpRnKkPc'),
