('QGMYzKSe5KY', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnR0a3h5MWJNa2dR', 'Analisis de los parámetros de una regresión lineal. Resultados de la funcion lm() en R', 'youtube#playlistItem', 'En este video explico como analisis los parámetros de una regresión. Armamos intervalos de confianza para los parámetros. También verificamos la significancia estadística y explicamos que otros resultados importantes de esta función en R.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n== Play List Ciencia de Datos===\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_H7Nzdk7wcnOX0YMjd4Kqz\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'eehQ80xV3kDEk6yV6qWnGPlBcR0', '2017-05-06T02:44:51Z', 2082, 18, 3, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/QGMYzKSe5KY\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/QGMYzKSe5KY'),
('fYPh7XmJ894', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlFHTVl6S1NlNUtZ', 'Regresiones lineal con R -  Función lm()', 'youtube#playlistItem', 'En esta clase explico como hacer una regresión lineal con R. Así como visualizar cada uno de los parámetros de la regresión.\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n== Play List Ciencia de Datos===\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_H7Nzdk7wcnOX0YMjd4Kqz\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'xJe_FID9FJKNMjLgyMJ62E5YfZc', '2017-05-05T16:23:00Z', 4671, 34, 3, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/fYPh7XmJ894\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/fYPh7XmJ894'),
('V_rE5My3PqY', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmZZUGg3WG1KODk0', 'Introducción a regresiones lineal con R', 'youtube#playlistItem', 'Este video requiere alto conocimiento del lenguaje de programación R. También tener una muy buena base matemática. En el se explica que es una regresión lineal y que fundamenta la funcion lm() que sirve en R para hacer regresiones lineales. Es el primer video de una serie de videos tomados durante mi clase de ciencia de datos.\n\n====Dataset=====\nhttp://www-bcf.usc.edu/~gareth/ISL/data.html\n\n====Código=====\nhttp://rpubs.com/chzelada/271399\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n== Play List Ciencia de Datos===\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_H7Nzdk7wcnOX0YMjd4Kqz\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'kXr4-qV2XjrB6B2yBJh1Qq7cRk4', '2017-05-05T15:54:39Z', 3107, 31, 2, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/V_rE5My3PqY\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/V_rE5My3PqY'),
('nnjAiI2Hjvg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlZfckU1TXkzUHFZ', 'Obtención de conocimiento en base a data', 'youtube#playlistItem', 'La obtención de conocimiento a partir de datos requiere seguir un estándar y es un método interactivo. En este video explico es estándar y como hacerlo.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n== Play List Ciencia de Datos===\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_H7Nzdk7wcnOX0YMjd4Kqz\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '4MMPN47wwMHXiR_wkXiZyUenHG4', '2017-05-04T16:07:00Z', 910, 20, 0, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/nnjAiI2Hjvg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/nnjAiI2Hjvg'),
('XtUWn357rGA', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lm5uakFpSTJIanZn', 'Resumen de diferentes algoritmos usados en ciencia de datos', 'youtube#playlistItem', 'En esta clase se resumen varios de los diferentes algoritmos que se usan usualmente en ciencia de datos. Algoritmos para creas ilustres, para predecir categorías, y para predecir un valor. Se ven los que son supervisados y no supervisados.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n== Play List Ciencia de Datos===\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_H7Nzdk7wcnOX0YMjd4Kqz\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'ekB-GFhEjjqdVf3qxGR-KxIP2OQ', '2017-05-04T16:02:50Z', 3523, 63, 4, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/XtUWn357rGA\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/XtUWn357rGA'),
('VTAAA9a1low', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Llh0VVduMzU3ckdB', 'Introducción a la ciencia de datos o minería de datos', 'youtube#playlistItem', 'Este video es un extracto de mi clase sobre ciencia de datos. En el hago una comparación entre ciencia de datos, minería de datos, aprendizaje estadístico.\nSe presenta a manera de ejemplos dos casos y se da una breve explicación de cada uno de los tipos de problemas que se pueden resolver. Es parte de un curso completa de ciencia de datos usando el lenguaje de programación R\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/academatica\n\n== Play List Ciencia de Datos===\nhttps://www.youtube.com/playlist?list=PLAFn9q_BCao_H7Nzdk7wcnOX0YMjd4Kqz\n\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'xJzTVesw4QLQP4em10HIDMy1eOc', '2017-05-04T15:25:24Z', 9750, 123, 11, 0, 9, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/VTAAA9a1low\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/VTAAA9a1low'),
('qEMpCnPKORA', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlZUQUFBOWExbG93', 'Técnicas de conteo. Probabilidad. Ejercicios 2.46 2.49 2.53 Mendenhall', 'youtube#playlistItem', 'Tres ejercicios resueltos del libro Estadística matemática de Wackerly - Mendenhall - Scheaffer.\n\n2.46 Diez equipos están jugando en un torneo de baloncesto. En la primera ronda, a los equipos se les asignan\nal azar los juegos 1, 2, 3, 4 y 5. ¿En cuántas formas pueden ser asignados los equipos a los juegos?\n\n2.49 Los estudiantes que asisten a clase en la Universidad de Florida pueden seleccionar de entre 130 disci- plinas de posgrado. El posgrado de un estudiante se identifica en los registros del secretario general de la universidad con un código de dos o tres letras (por ejemplo, los posgrados en estadística se identifican con STA, los de matemáticas con MS). Algunos estudiantes optan por dos posgrados y completan los requisitos para ambos antes de graduarse. Al secretario general se le pidió considere asignar a estos dos posgrados un código diferente de dos o tres letras para que puedan ser identificados en el sistema de registro del estudiante.\na ¿Cuál es el número máximo de posibles posgrados dobles disponibles para estudiantes de la Universidad de Florida?\nb Si existe cualquier código de dos o tres letras para identificar posgrados individuales o dobles,¿de cuántos códigos de posgrado se dispone?\nc ¿Cuántos códigos de posgrado se requieren para identificar estudiantes que tienen ya sea un posgrado individual o uno doble?\nd ¿Hay suficientes códigos de posgrado paraidentificar todos los posgrados individuales o dobles en la Universidad de Florida?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'KcZmznUX2LXxlLqhPlJW-Ogbapw', '2017-05-04T01:59:04Z', 12899, 67, 4, 0, 4, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/qEMpCnPKORA\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/qEMpCnPKORA'),
('T5BgTr37y2A', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnFFTXBDblBLT1JB', 'Técnicas de conteo. Probabilidad. Ejercicios 2.55 2.56 2.58 2.63 Mendenhall', 'youtube#playlistItem', 'Tres ejercicios resueltos del libro Estadística matemática de Wackerly - Mendenhall - Scheaffer.\n\n2.55 Se ha de realizar un estudio en un hospital para determinar las actitudes de los enfermeros hacia diversos procedimientos administrativos. Se ha de seleccionar una muestra de 10 enfermeros de entre un total de 90 enfermeros empleadas por el hospital.\na) ¿Cuántas muestras diferentes de 10 enfermeros se pueden seleccionar?\nb) Veinte de los 90 enfermeros son hombres. Si 10 enfermeros se seleccionan al azar entre los empleados por el hospital, ¿cuál es la probabilidad de que la muestra de diez incluirá exactamente 4 hombres (y 6 mujeres) enfermeros?\n\n2.56 Una estudiante se prepara para un examen estudiando una lista de diez problemas. Ella puede resolver seis de ellos. Para el examen, el profesor selecciona cinco problemas al azar de los diez de la lista dada a los estudiantes. ¿Cuál es la probabilidad de que la estudiante pueda resolver los cinco problemas del examen?\n\n2.58 Se reparten cinco cartas de una baraja de 52 cartas. ¿Cuál es la probabilidad de sacar\n\na. 3 ases y 2 reyes?\nb. un “full” (tres cartas de una clase, 2 cartas de otra clase)?\n\n2.63 Los ocho miembros del Consejo Asesor de Relaciones Humanas de Gainesville, Florida, consideró la queja de una mujer que alegaba discriminación, basada en su género, de parte de una empresa local. El Consejo, compuesto de cinco mujeres y tres hombres, votó 5–3 a favor de la quejosa, con las cinco mujeres votando a favor de ella y los tres hombres en contra. El abogado que representaba a la compañía apeló la decisión del Consejo reclamando sesgo de género de parte de los miembros del Consejo. Si no hubo sesgo de género entre los miembros del Consejo, podría ser razonable hacer conjeturas de que sería probable que cualquier grupo de cinco miembros votara a favor de la quejosa como lo haría cualquier otro grupo de cinco. Si éste fuera el caso, ¿cuál es la probabilidad de que el voto se dividiera por líneas de género (cinco mujeres a favor, tres hombres en contra)?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'Hg06ayzJhVuECPgT2IggFPCUysc', '2016-03-15T13:07:19Z', 51224, 261, 93, 0, 18, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/T5BgTr37y2A\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/T5BgTr37y2A'),
('EkOeacOfnX4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlQ1QmdUcjM3eTJB', 'Técnicas de conteo. Probabilidad. Ejercicios 2.37 2.43 2.44 Mendenhall', 'youtube#playlistItem', 'Tres ejercicios resueltos del libro Estadística matemática de Wackerly - Mendenhall - Scheaffer.\n\n2.37 Una mujer de negocios de Filadelfia está preparando su itinerario para una visita a seis ciudades impor- tantes. La distancia recorrida y por tanto el costo del viaje, dependerá del orden en que ella planee su ruta.\na ¿Cuántos itinerarios diferentes (y costos de viaje) son posibles?\nb Si la mujer selecciona al azar uno de los posibles itinerarios y Denver y SanFrancisco son dos de las\nciudades que ella piensa visitar, ¿cuál es la probabilidad de que visite Denver antes de San Francisco?\n\n2.43 Una flota de nueve taxis se ha de despachar a tres aeropuertos en forma tal que tres vayan al aeropuerto A, cinco al aeropuerto B y uno al aeropuerto C. ¿En cuántas formas distintas se puede lograr esto?\n\nConsulte el Ejercicio 2.43. Suponga que los taxis son asignados a aeropuertos al azar.\na Si exactamente uno de los taxis necesita reparación, ¿cuál es la probabilidad de que sea despachado\nal aeropuerto C?\nb Si exactamente tres de los taxis necesitan reparación,¿cuál es la probabilidad de que cada aeropuerto reciba uno de los taxis que necesita reparación?\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '2jbigqexbuqkgmVAfJT2aC5SBm4', '2016-03-15T13:11:25Z', 15738, 104, 5, 0, 11, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/EkOeacOfnX4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/EkOeacOfnX4'),
