('KDYvH8LwpTA', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkZCY21yMmlfY3dN', 'Distribución binomial. Ejemplo 3', 'youtube#playlistItem', 'En este video resolveremos el siguiente problema.\nEl fabricante de una bebida láctea de bajo contenido de calorías desea comparar el atractivo del gusto de una nueva fórmula (fórmula B) con el de la fórmula estándar (fórmula A). A cada uno de cuatro jueces se les dan tres vasos en orden aleatorio, dos de ellos con la fórmula A y el otro con la fórmula B. A cada uno de los jueces se les pide indicar cuál vaso fue el que disfrutó más. Suponga que las dos fórmulas son igualmente atractivas. Sea Y el número de jueces que indican una preferencia por la nueva fórmula.\n\na. Encuentre la función de probabilidad para Y.\nb. ¿Cuál es la probabilidad de que al menos tres de los cuatro jueces  indique una preferencia por la nueva fórmula?\nc. Encuentre el valor esperado de Y.\nd. Encuentre la varianza de Y.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'gYD-1a2i36mkfvWb5B9OWYpo9m4', '2014-03-29T00:59:03Z', 21237, 64, 5, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/KDYvH8LwpTA\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/KDYvH8LwpTA'),
