('kgokKiPXSQc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LktUQllqQnJwNUh3', 'Distribución binomial. Ejemplo 2', 'youtube#playlistItem', 'Es este video resolveremos el siguiente ejercicio,\n\nLa experiencia ha demostrado que 30% de todas las personas afectadas por cierta enfer- medad se recuperan. Una empresa fabricante de medicamentos ha inventado una nueva medicina. Diez personas con la enfermedad se seleccionaron al azar y recibieron la medici- na; nueve se recuperaron al poco tiempo. Suponga que la medicina no es eficaz en absoluto. ¿Cuál es la probabilidad de que se recuperen al menos nueve de entre diez que recibieron la medicina?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'qZM3qsBHhkyyTMrllr-1qU4_WPM', '2014-03-20T00:02:41Z', 33993, 68, 21, 0, 10, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/kgokKiPXSQc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/kgokKiPXSQc'),
