('YnlZNLzdXWE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LllDRzRCbTBEdk8w', 'Función caracteristica de la clase p', 'youtube#playlistItem', 'En este video aprenderemos como encontrar la función característica de la clase p.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'iHfkk_rTH77G5Vef71iQJtbeKY0', '2014-01-23T23:55:08Z', 1049, 1, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/YnlZNLzdXWE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/YnlZNLzdXWE'),
('hO3T-koqT5U', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LllubFpOTHpkWFdF', 'Probabilidad frecuencia relativa. Ejemplo 2', 'youtube#playlistItem', 'En este video resolveremos el siguiente problema sobre probabilidades.\n\nUn furgón de ferrocarril contiene seis sistemas electrónicos complejos. Dos de los seis se han de seleccionar al azar para hacerles pruebas completas y luego clasificarlos como defectuosos o no defectuosos.\na) Sidosdelosseissistemasenrealidadestándefectuosos,encuentrelaprobabilidad de que al menos uno de los dos sistemas probados sea defectuoso. Encuente la probabilidad de que ambos sean defectuosos.\nb) Si cuatro de los seis sistemas están defectuosos en realidad, encuentre las proba- bilidades indicadas en en inciso (a).\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'dC4a_AHClCvgv8gM4x5j-ljokDc', '2014-01-23T23:50:10Z', 10866, 32, 10, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/hO3T-koqT5U\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/hO3T-koqT5U'),
('kQJa81-COhw', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmhPM1Qta29xVDVV', 'Probabilidad frecuencia relativa. Ejemplo 1', 'youtube#playlistItem', 'En este video resolveremos el siguiente problema sobre probabilidad.\n\nCuatro personas igualmente calificadas hacen solicitud para ocupar dos puestos idén- ticos en una empresa. Un y sólo un solicitante es miembro de un grupo de minoría étnica. Los puestos se llenan al seleccionar dos de los solicitantes al azar.\na) Indique los posibles resultados para este experimento.\nb) Asigne probabilidades razonables a los puntos muestrales.\nc) Encuentre la probabilidad de que el solicitante del grupo étnico minoritario sea seleccionado para una posición.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'Y5ARJAK7C1gxrGB96fkpss9dRH8', '2014-01-23T18:30:38Z', 25607, 77, 18, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/kQJa81-COhw\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/kQJa81-COhw'),
('I7Wjp2zgx0w', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmtRSmE4MS1DT2h3', 'Probabilidad por frecuencia relativa', 'youtube#playlistItem', 'En este video aprenderemos que es la probabilidad y como es su definición por frecuencia relativa. Ademas demostraremos varias propiedades de la probabilidad.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'E9fUogPyh83Y7WjYH7gW5sfKE6w', '2014-01-23T18:15:25Z', 47520, 180, 35, 0, 6, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/I7Wjp2zgx0w\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/I7Wjp2zgx0w'),
