('3EKndPO8Pxs', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmNnWDU1TUVucm1V', 'Polinomios de Lagrange.  Aproximación polinomial de Lagrange.', 'youtube#playlistItem', 'En este video aprenderemos sobre como interpolar un polinomio usando el método de la aproximación polinomial de Lagrange. Este en dos partes en esta primera parte explico de donde sale el método y como aplicarlos para aproximar polinomios de diferentes grados a una tabla.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'Hh-QYA91ftPd6L1qK6RR_HARQrY', '2013-10-15T03:22:27Z', 41399, 110, 26, 0, 9, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/3EKndPO8Pxs\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/3EKndPO8Pxs'),
