('91cZjbkEi1g', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnNqdEY4WUtxc2pN', 'Ecuaciones dinámicas de circuitos eléctricos EJEMPLO 1', 'youtube#playlistItem', 'ESTE VIDEO NO ES PARA PRINCIPIANTES EN CIRCUITOS. Una vez dicho esto, en este video explico como encontrar las ecuaciones dinámicas de un circuito RLC que tiene solamente un nodo.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'Ps4BpbRVWMOmCs3ok2Q1k3XW1b0', '2013-10-12T15:52:31Z', 139444, 654, 93, 0, 29, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/91cZjbkEi1g\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/91cZjbkEi1g'),
('qKtqobWu2z4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjkxY1pqYmtFaTFn', 'Ejemplo 4 de trabajo - Aplicaciones de la integral', 'youtube#playlistItem', 'En este ejemplo de trabajo resolveremos el siguiente ejercicio.\nUna cadena que se encuentra sobre el piso mide 10 m de largo y su masa es de 80 kg. ¿Cuánto trabajo se requiere para levan- tar un extremo de la cadena a una altura de 6 m?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'DpeQqgddByarZe7Xy_g1Yo4pEIo', '2013-10-12T15:27:33Z', 19280, 94, 67, 0, 13, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/qKtqobWu2z4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/qKtqobWu2z4'),
('pI8tEVemM4Q', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnFLdHFvYld1Mno0', 'Ejemplo 3 de trabajo   Aplicaciones de la integral', 'youtube#playlistItem', 'En este ejemplo de trabajo resolveremos el siguiente ejercicio.\nSi 6 J de trabajo se requieren para estirar un resorte de 10 cm a 12 cm y otros 10 J son necesarios para estirarlo de 12 cm a 14 cm, ¿cuál es la longitud natural del resorte?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'HljtzkvK4FYPpceun0kdpSQdTdI', '2013-10-02T16:38:53Z', 19676, 76, 8, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/pI8tEVemM4Q\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/pI8tEVemM4Q'),
('htxzrziU6fo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnBJOHRFVmVtTTRR', 'Ejemplo 2 de trabajo - Aplicaciones de la integral', 'youtube#playlistItem', 'En este ejemplo de trabajo resolveremos el siguiente ejercicio.\nSi el trabajo requerido para estirar un resorte 1 ft más que su longitud natural es 12 ft-lb, ¿cuándo trabajo es necesario para estirarlo 9 in más que su longitud natural?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'l7Efx2nZog2jJaXPgNSXuf2VUtk', '2013-10-02T16:30:31Z', 20434, 74, 23, 0, 6, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/htxzrziU6fo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/htxzrziU6fo'),
('ShfIfCQGEHU', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lmh0eHpyemlVNmZv', 'Ejemplo 1 de trabajo - Aplicaciones de la integral', 'youtube#playlistItem', 'En este ejemplo de trabajo resolveremos el siguiente ejercicio.\nUn resorte tiene una longitud natural de 20 cm. Si una fuerza de 25 N se requiere para mantenerlo estirado a una longitud de 30 cm, ¿cuánto trabajo se requiere para estirarlo de 20 cm a 25 cm?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'I4_ZWcRxOFoC7WaVw-LmE7k6gjU', '2013-10-02T15:49:56Z', 45571, 218, 37, 0, 15, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ShfIfCQGEHU\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ShfIfCQGEHU'),
('7XIHmslyM74', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlNoZklmQ1FHRUhV', 'Introduccion a trabajo - Aplicaciones de la integral', 'youtube#playlistItem', 'En este video hablo sobre el trabajo. Lo que se va a aprender en esta clase es como surge la necesidad de usar la integral para calcular el trabajo hecho por una fuerza cuando la fuerza es una función continua en in intervalo de distancia. Empiezo recordando como calcular el trabajo cuando la fuerza es constante o cuando es una función escalonada para luego dar la forma continua como una integral.\n\nAl final del video dejo un link al primer ejemplo.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'pdqG95YPHWknsEExuHCwM4mdmHM', '2013-10-02T15:40:54Z', 49400, 333, 38, 0, 22, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/7XIHmslyM74\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/7XIHmslyM74'),
