('iH6PQnfcd8o', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkM5aTdaVkhKWkpF', 'Volumen por el método de capas cilindricas', 'youtube#playlistItem', 'El método de capas proporciona una forma alternativa de calcular volúmenes de sólidos de revolución. En ciertos casos es el único método viable porque el de las secciones transversales puede resultar a veces difícil de aplicar o no puede aplicarse en absoluto.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'HQHzEO_gBc9UzQMJl9L9mXmY2Oo', '2013-09-16T05:35:52Z', 76048, 183, 123, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/iH6PQnfcd8o\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/iH6PQnfcd8o'),
