INSERT INTO `videos` (`video_id`, `id`, `title`, `kind`, `description`, `etag`, `published_at`, `views`, `likes`, `dislikes`, `favorites`, `comments`, `iframe`, `link`) VALUES
('dwtBa07rzX0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlJnT09SMVBxWTlj', 'Solución de ecuaciones dinámicas por Laplace.', 'youtube#playlistItem', 'En este video explico como encontrar la solución de un sistema cuando conocemos sus ecuaciones dinámicas usando la transformada de Laplace. También en este video aparece por primera vez a matriz de transición de estados y el estado asociado. Esta forma de solución nos permite trabajar la solución usando una computadora. En esta clase hago también dos ejemplos cuyos vídeos puedes encontrar en mi canal de youtube.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'SOH8pGeAL2z6EmUQoKdv5MGhJUs', '2013-09-08T18:15:42Z', 2102, 12, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/dwtBa07rzX0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/dwtBa07rzX0'),
('72xMCaF5nds', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmR3dEJhMDdyelgw', 'Propiedades de la integral definida - Propiedades 7, 8 y 9', 'youtube#playlistItem', 'En este video demustro la propiedades de comparación de la integral definida.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'z064fdX4f_wO4ikWsvyyW6eki8s', '2013-09-08T17:17:39Z', 8848, 78, 6, 0, 7, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/72xMCaF5nds\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/72xMCaF5nds'),
('Z854tgFh4g8', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjcyeE1DYUY1bmRz', 'Propiedades de la integral definida - Propiedades 4, 5 y 6', 'youtube#playlistItem', 'Propiedad 4 es que la integral de una suma (Resta) es la suma (Resta) de las integrales. La propiedad 5 es que la integral de una constante por una función es la constante por la integral de la función. La propiedad 6 dice que la integral en un intervalo se puede partir en subintervalos.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'rPr_MxVKirlk4j41yOxqgVlzVlw', '2013-09-06T00:16:37Z', 8723, 54, 3, 0, 3, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Z854tgFh4g8\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Z854tgFh4g8'),
('lsCKfRbcmjE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Llo4NTR0Z0ZoNGc4', 'Propiedades de la integral definida - Propiedades 1, 2 y 3', 'youtube#playlistItem', 'La propiedad 1 es de la inversión del intervalo de integración. La segunda Propiedad nos dice que si el intervalo de integración no varia el integral es cero. La tercera nos dice que la integral de una constante es la contante por la longitud del intervalo. Para cada propiedad hago su DEMOSTRACION.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'Zuwa4W7SHuvltCM_xUc7MCojt5c', '2013-09-05T23:48:27Z', 29816, 179, 35, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/lsCKfRbcmjE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/lsCKfRbcmjE'),
('lZhAI3yH1Dc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmxzQ0tmUmJjbWpF', 'Regla del punto medio - Integral definida', 'youtube#playlistItem', 'En este video explico la regla del punto medio para calcular la integral de una función. También hago un ejemplo.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'p7hfUSTD9NiADFhE9gkerRW2niA', '2013-09-05T23:25:01Z', 71883, 338, 25, 0, 26, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/lZhAI3yH1Dc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/lZhAI3yH1Dc'),
