('pnfCX0ZVYic', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnlCdjNmYl92bGtr', 'Problemas de Optimizacion - Libro de Stewart  Problema 24', 'youtube#playlistItem', 'Un cilindro circular recto está inscrito en un cono con altura h y radio r de la base. Encuentre el volumen mas grande posible de este cilindro.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'p5bY8FTsdz9JMpL_G1HYBJmr3NE', '2013-08-01T15:15:01Z', 147938, 782, 145, 0, 61, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/pnfCX0ZVYic\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/pnfCX0ZVYic'),
('CfCu6SmoWCU', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnBuZkNYMFpWWWlj', 'Problemas de Optimizacion - Libro de Stewart Problema 31', 'youtube#playlistItem', 'Si un resistor de R ohms se conecta en paralelo a una batería de E volts con resistencia interna de r ohms, entonces la potencia (en watts) en el resistor externo es P=E^2R/(R+r)^2 Si E y r son fijos pero R varia, ¿Cual es el valor máximo de la potencia?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'huIALFjW5W6XbT7N9x8X9GnOwNE', '2013-07-24T02:30:49Z', 6245, 44, 1, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/CfCu6SmoWCU\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/CfCu6SmoWCU'),
('-tT9tFyFSKA', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkNmQ3U2U21vV0NV', 'Problemas de Optimizacion - Libro de Stewart Problema 15', 'youtube#playlistItem', 'Encuentre los puntos en la elipse 4x^2+y^2=4 que estén más alejados del punto (1, 0)\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'ezTPUN2GE59exTNszwyfn6bR3s8', '2013-07-24T01:10:38Z', 15381, 85, 5, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/-tT9tFyFSKA\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/-tT9tFyFSKA'),
('jtGYI9H2DCc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Li10VDl0RnlGU0tB', 'Problemas de Optimizacion - Libro de Stewart Problema 23', 'youtube#playlistItem', 'Halle las dimensiones del rectángulo con el área más que se pueda inscribir en un triángulo equilátero de lado L si un lado del rectángulo se encuentra en la case del triángulo.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '9o8jGiDjr-UujN7YOkWh_jNOqKE', '2013-07-23T23:25:47Z', 37390, 190, 23, 0, 15, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/jtGYI9H2DCc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/jtGYI9H2DCc'),
('_2AqkIL0Obs', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lmp0R1lJOUgyRENj', 'Relaciones Afines - Libro Stewart Capitulo 3 Seccion 9 Problema 33', 'youtube#playlistItem', 'Si se conectan dos resistencias R_1 y R_2 en paralelo, como se \nilustra en la figura, por lo tanto la resistencia total R, medida en\nohm (Ω) es\n1/R = 1/R_1 + 1/R_2\nSi R_1 y R_2 se incrementan en proporción de 0.3 Ω/s y 0.2 Ω/s,\nrespectivamente, ¿Qué tan rápido cambia R cuando R_1 = 80Ω \ny R_2 = 100Ω?       \n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'ZlH97_FRl6B0_nFMYGqfOmSdto0', '2013-07-23T17:31:45Z', 5800, 80, 1, 0, 5, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/_2AqkIL0Obs\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/_2AqkIL0Obs'),
('2oMuASFTAiE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Ll8yQXFrSUwwT2Jz', 'Relaciones Afines   Libro Stewart Capitulo 3 Seccion 9 Problema 28', 'youtube#playlistItem', 'Un papalote que está a 100 pies por arriba de la superficie de la tierra se desplaza en forma horizontal a una rapidez de 8 pies/s.¿En que proporción disminuye el ángulo entre la cuerda y la horizontal cuando se han soltado 200 pies de cuerda?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'hZNs_n6Zc8SdkkcL5pNRXvAagjs', '2013-07-12T14:17:06Z', 18557, 93, 23, 0, 9, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/2oMuASFTAiE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/2oMuASFTAiE');
