('-1q-1RrZE00', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjJvTXVBU0ZUQWlF', 'Relaciones Afines -  Libro Stewart Capitulo 3 sección 9 problema 27', 'youtube#playlistItem', 'Se entrega grava por medio de una cinta transportadora a razón de 30 pies cúbicos por minuto; las dimensiones de sus fragmentos permiten formar una pila en forma de cono cuyo diámetro y altura son siempre iguales. ¿Qué tan rápido se incrementa la altura de la pila cuando ésta mide 10 pies de alto?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'eapkEQYw_aXoskKXC_Sl3xmMPo0', '2013-07-12T13:35:21Z', 16606, 92, 53, 0, 12, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/-1q-1RrZE00\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/-1q-1RrZE00'),
('Z372QFk9r00', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Li0xcS0xUnJaRTAw', 'Relaciones Afines - Libro Stewart Capitulo 3 sección 9 problema 20', 'youtube#playlistItem', 'Una embarcación se jala hacia un muelle mediante una soga unida a la proa del bote y pasa por una polea que se encuentra  instalada en el muelle a 1 m más arriba que la proa del bote. Si la soga se jala a una rapidez de 1 m/s, ¿qué tan rápido se aproxima al muelle cuando está a 8 m de éste?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'SOSgcNcJeBw05g6xk5SPISWj_7o', '2013-07-11T17:19:50Z', 12935, 85, 7, 0, 6, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Z372QFk9r00\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Z372QFk9r00'),
('KRWb5bt8u8M', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlozNzJRRms5cjAw', 'Razones de Cambio - Libro Stewart - capitulo 3 sección 9 problema 3', 'youtube#playlistItem', 'El largo de un rectángulo se incrementa a razón de\n8 cm/s y el ancho en 3 cm/s. Cuando la longitud es de 20 cm y\nel ancho es de 10 cm, ¿qué tan rápido se incrementa el área del\nrectángulo?\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '-14d9vh21zrJoSOmbIzyHOTvn0c', '2013-07-11T17:09:46Z', 56308, 365, 19, 0, 9, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/KRWb5bt8u8M\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/KRWb5bt8u8M'),
('gfbWP0qNsBg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LktSV2I1YnQ4dThN', 'Transformada de Fourier - Propiedades con la convolución - Demostraciones', 'youtube#playlistItem', 'En este video demuestro tres propiedades de la transformada de fourier con la convolución.\n\n1. La integral de una convolucion es la multiplicación de las integrales de las funciones.\n2. La transformada de Fourier de una convolución es la multiplicación de las transformadas de Fourier de cada función.\n3. La transformada de fourier de una multiplicación des la convolución de las transformadas de Fourier de cada función multiplicado por 1 sobre 2π\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'vY28hfFuhXjhKXP3jpyi8kxldOw', '2013-07-11T15:07:53Z', 23586, 92, 11, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/gfbWP0qNsBg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/gfbWP0qNsBg'),
