('8_L3rV9hDOE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlhNQnRsN0d6bXFn', 'Problemas de optimización - Ejemplo #7', 'youtube#playlistItem', 'En este video doy un ejemplo de como resolver un problema de optimización.\n==Problema 29 sección 4.7 del libro de Stewart==\nEn un cartel rectangular los márgenes superior e inferior miden 6 cm cada uno y los laterales, 4 cm. Si el área de material impreso se fija en 384 cm^2, ¿Cuáles son las dimensiones del cartel de área mínima? \n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '09T6Lj_asGtZ_vN1fMN4AzL_9Os', '2013-06-11T00:17:04Z', 80487, 618, 75, 0, 52, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/8_L3rV9hDOE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/8_L3rV9hDOE'),
('kuYDcGIsHwo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjhfTDNyVjloRE9F', 'Problemas de optimización - Ejemplo #6', 'youtube#playlistItem', 'En este video doy un ejemplo de como resolver un problema de optimización.\n==Problema 24 sección 4.7 del libro de Stewart==\nHalle el área del rectángulo más grande que se pueda inscribir en un triángulo rectángulo con catetos cuyas \nlongitudes son de 3 cm y 4 cm, respectivamente, si dos de los lados del rectángulo se encuentran a lo largo \nde los catetos.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'khLDwdG9Pu6kkREglGXBh5qr26A', '2013-06-06T19:21:12Z', 86095, 813, 41, 0, 38, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/kuYDcGIsHwo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/kuYDcGIsHwo'),
('ODG7PqIVwNg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lmt1WURjR0lzSHdv', 'Problemas de optimización - Ejemplo #5', 'youtube#playlistItem', 'En este video doy un ejemplo de como resolver un problema de optimización.\n\nUna ventana normanda tiene forma de rectángulo rematado por un semicírculo. Si el perímetro de la ventana es \nde 30 pies, encuentre las dimensiones de la ventana de modo que entre la cantidad más grande de luz.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'nKhRvc2Q0Mb96F_9Ld2wDXvk1Zc', '2013-06-06T18:18:28Z', 110525, 541, 192, 0, 76, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ODG7PqIVwNg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ODG7PqIVwNg'),
('4IXfrfvFUgI', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk9ERzdQcUlWd05n', 'Problemas de optimización - Ejemplo #4', 'youtube#playlistItem', 'En este video doy un ejemplo de como resolver un problema de optimización.\n\nCon cuatro pies de alambre se desean construir un circulo y un cuadrado, cuanto alambre hay que emplear en cada figura para lograr que entre ambas encierren el área máxima posible?\n\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'XYyoqnPNH1CVuzD-d7DTAUiVS8s', '2013-06-05T00:36:42Z', 47996, 260, 39, 0, 33, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/4IXfrfvFUgI\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/4IXfrfvFUgI'),
('bFTJvx5RjAw', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjRJWGZyZnZGVWdJ', 'Problemas de optimización - Ejemplo #3', 'youtube#playlistItem', 'En este video doy un ejemplo de como resolver un problema de optimización.\n\nEncuentre los puntos sobre la hipérbola y^2-x^2=4 que están más próximos \nal punto (2, 0).\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'hA0-FSAO8qcPiqu5DSvcUnf3Ygs', '2013-06-04T19:42:46Z', 61043, 260, 27, 0, 25, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/bFTJvx5RjAw\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/bFTJvx5RjAw'),
('wtvlyFDx63o', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmJGVEp2eDVSakF3', 'Problemas de optimización - Ejemplo #2', 'youtube#playlistItem', 'En este video doy un ejemplo de como resolver un problema de optimización.\n\nUn fabricante desea diseñar una caja abierta con base cuadrada y un área de 108 pulgadas cuadradas de superficie. ¿Qué dimensiones producen la caja de máximo volumen?\n\n=== Partes del video ==\n\n0:00 Introduccion\n0:18 Enunciado del problema\n0:32 Plateamiento del problema\n1:05 Funcion Objetivo\n1:22 Restriccion\n1:53 Plateamiento Matematico de la funcion objetivo\n2:38 Plateamiento Matematico de la restriccion\n3:59 Solucion\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'D91R7OGkVeVtvnK0ksXXNvvvM4g', '2013-06-03T23:22:11Z', 249916, 1183, 63, 0, 136, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/wtvlyFDx63o\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/wtvlyFDx63o'),
('XSZYdTgMMp8', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lnd0dmx5RkR4NjNv', 'Problemas de optimización - Ejemplo #1', 'youtube#playlistItem', 'En este video doy un ejemplo de como resolver un problema de optimización.\n\nCon el proposito de tener mayor seguridad, un fabricante planea cercar un área de almacenamiento rentangular de 10,800 pies cuadrados, que es adyacente a un edificio, el cual utilizara como uno de los lados del área cercada. La cerca paralela al edificio da a una carretera y costara $3 por pie intalado, mientras que la cerca de los otros lados costara $2 por pie instalado. Encontrar la cantidad de cada tipo de cerca, de manera que el costo total sea mínimo. ¿Cuál es el costo mínimo?\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'wzsVjQ0U9M-EIrO5VCTA61-ffIk', '2013-06-03T23:11:27Z', 51145, 193, 29, 0, 46, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/XSZYdTgMMp8\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/XSZYdTgMMp8'),
