('N0kE2KX4X9g', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlpYRVVYazQzVVc0', 'Transformada de Laplace por definicion', 'youtube#playlistItem', 'En estos video trabajo la transformada de Laplace desde su definición muy diferente enfoque al que le di en los primeros videos de Laplace. Como ejemplos hago la transformada de laplace de una constante. La transformada de laplace de t^n, la transformada de laplace de e^at (exponencial) y la transformada del seno.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'y827FPyI_OfL6Lm0fP8s2-4h1rc', '2013-03-16T17:48:08Z', 63281, 361, 30, 0, 21, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/N0kE2KX4X9g\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/N0kE2KX4X9g'),
('Z9EJ0sCDgOE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk4wa0UyS1g0WDln', 'Ejemplos del teorema de Stokes', 'youtube#playlistItem', 'En este video hago 5 ejemplos del uso del teorema de Stokes para calcular integrales de superficie y integrales de linea.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'cMWWbCuuMyzR3J7FfqT3TQVpwDs', '2013-03-15T20:25:32Z', 142614, 844, 126, 0, 92, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Z9EJ0sCDgOE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Z9EJ0sCDgOE'),
('Q9o8sZ8m4II', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Llo5RUowc0NEZ09F', 'Ejemplos de integrales por sustitución trigonométrica', 'youtube#playlistItem', '====Técnicas de integración mas vídeos ======\n➤ Sustitución http://youtu.be/qBeh8l5H9H4 \n➤ Por partes  http://youtu.be/K8NL2Rwv0u0\n➤ Integrales trigonométricas http://youtu.be/owqWXgf9alg\n➤ Sustitución trigonométrica http://youtu.be/Q9o8sZ8m4II\n➤ Fracciones Parciales http://youtu.be/F1DVFLmbDNk\n\n====Contenido====\n\n0:00 Intro\n3:13 Integral 1\n11:14 Integral 2\n15:54 Integral 3\n24:51 Integral 4\n34:16 Integral 5\n38:55 Integral 6\n42:51 Integral 7\n49:32 Integral 8\n56:10 Integral 9\n59:06 Integral 10\n1:04:25 Integral 11\n1:18:49 Integral 12\n1:22:52 Integral 13\n1:25:16 Integral 14\n1:33:13 Final\n\nEn este video resuelvo varios ejercicios de integrales por sustitución trigonométrica. Al inicio solo tienes que escoger la integral que quieras ver su solución.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'Qv5Ey1-hqmGJDq3ARKV3j-0i5nc', '2013-03-09T14:57:45Z', 431433, 2543, 148, 0, 138, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Q9o8sZ8m4II\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Q9o8sZ8m4II'),
('KrXdiEb1iO8', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlE5bzhzWjhtNElJ', 'Teorema de bayes', 'youtube#playlistItem', 'Visita: http://bit.ly/W-bayes FB: http://bit.ly/academatica\nEn este video demuestro el teorema de bayes. Tambien hago un ejemplo.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'wImCJBDuKptkX3fz_IUZuppVgfI', '2013-03-07T00:16:38Z', 19342, 123, 9, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/KrXdiEb1iO8\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/KrXdiEb1iO8'),
('GBo6nwrtqXk', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LktyWGRpRWIxaU84', 'Medias perpendiculares y circuncentro de un triángulo', 'youtube#playlistItem', 'En este video explico cuales son las medias perpendiculares de un triángulo y donde esta el circuncentro de un triángulo. el circuncentro es el centro de la circunferencia circunscrita.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'iyZXAyYAbYgjKZvVsIY-Sev8_Cw', '2013-03-06T17:40:55Z', 736, 6, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/GBo6nwrtqXk\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/GBo6nwrtqXk'),
