('MiHpezNEl_Q', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjVqTkpWcHhzMTBV', 'Ejercicios resueltos de derivadas parciales', 'youtube#playlistItem', 'Visita: http://bit.ly/Ejemplos-Derivadas-Parciales FB: http://bit.ly/academatica\nEn este video resuelvo varios ejercicios de derivadas parciales. Hago las primeras derivadas parciales de funciones de dos, tres, cuatro y n-variables.\n==Siguiente tema==\nPlano Tangentes\nhttp://www.youtube.com/watch?v=sSJZHJlmdnA\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'IR7BgXL-KPsYzcGioa6cVfj9GjQ', '2013-03-03T03:04:56Z', 327706, 1468, 81, 0, 89, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/MiHpezNEl_Q\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/MiHpezNEl_Q'),
