('owqWXgf9alg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjlSTkRSZnpncUln', 'Ejemplos de integrales que contienen senos y cosenos - Pares e impares del libro de Stewart', 'youtube#playlistItem', 'En este video resuelvo algunos ejercicios pares e impares del capitulo de integrales trigonometricas del libro de calculo de James Stewart. HAZ CLICK EN MOSTRAR MAS\n====Técnicas de integración mas vídeos ======\n➤ Sustitución http://youtu.be/qBeh8l5H9H4 \n➤ Por partes  http://youtu.be/K8NL2Rwv0u0\n➤ Integrales trigonométricas http://youtu.be/owqWXgf9alg\n➤ Sustitución trigonométrica http://youtu.be/Q9o8sZ8m4II\n➤ Fracciones Parciales http://youtu.be/F1DVFLmbDNk\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Audio ==\nEl audio usado en este video es bajo la licencia creative commons y puedes encontrar el track en http://audiofarm.org/audiofiles/20219', '3yKlae7I3fgRwvnO_E-rMNRnlSg', '2013-02-28T15:13:21Z', 99878, 296, 14, 0, 47, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/owqWXgf9alg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/owqWXgf9alg'),
