('0KyJDamOegE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lkl2RGlpMjA1Rkc0', 'Video de sumatoria - Ejemplos', 'youtube#playlistItem', 'http://bit.ly/Sumatoria\nEn este video doy ejemplos de como aplicar la notación de sumatoria. \n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Video de sumatoria - introducción ==\nhttp://youtu.be/lXjYzwRaWxY', 'xuuFvm348wJSUuEQ9MFqOfFDraM', '2013-01-04T16:16:58Z', 25665, 53, 8, 0, 10, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0KyJDamOegE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/0KyJDamOegE'),
('lXjYzwRaWxY', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjBLeUpEYW1PZWdF', 'Video de Sumatoria - introducción', 'youtube#playlistItem', 'http://bit.ly/Sumatoria\nEs este video explico que es una sumatoria y como calcular una sumatoria. También explico las partes importantes de esta notación sumatoria.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Video de sumatoria - ejemplos ==\nhttp://youtu.be/0KyJDamOegE', 'W-I7IFcej0tu5hHAbsTD2tlD7qI', '2013-01-04T02:47:49Z', 18400, 44, 11, 0, 16, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/lXjYzwRaWxY\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/lXjYzwRaWxY');
