('-Sug_-XSbeE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmxYall6d1JhV3hZ', 'Video de sucesiones - Convergencia', 'youtube#playlistItem', 'En este video de sucesiones explico la definición de convergencia de una sucesión. También hago varios ejercicios donde se pide que se encuentre si la sucesión es convergente o no. También hablamos del límite al infinito.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Mas vídeos sobre sucesiones==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao95s22dRfaKHaPY_bazObJf', 'i7crXV8C17giajei8JjRFbw7dOw', '2013-01-04T02:40:40Z', 54690, 219, 40, 0, 25, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/-Sug_-XSbeE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/-Sug_-XSbeE'),
('ya4Q5mwIXA4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Li1TdWdfLVhTYmVF', 'Video de sucesiones - Máximo, Supremo, Mínimo, ínfimo, monotonía', 'youtube#playlistItem', 'En este video de sucesiones explico que el el máximo, supremo, mínimo, ínfimo de una sucesión. También explico como saber la monotonía de una sucesión que puede ser monótona creciente o monótona decreciente o puede ser que no sea monótona. Cada tema va con su respectivo ejemplo.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Mas vídeos sobre sucesiones==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao95s22dRfaKHaPY_bazObJf', 'GDy02NSGfM9atGtWDZS3CukItpQ', '2012-12-28T22:57:40Z', 31884, 205, 26, 0, 23, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ya4Q5mwIXA4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/ya4Q5mwIXA4'),
('Xe78vH1zWyQ', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnlhNFE1bXdJWEE0', 'Video de sucesiones - Punto de acumulación', 'youtube#playlistItem', 'En este video de sucesiones explico que es el punto de acumulación de una sucesión. También demuestro que el punto de acumulacion de 1/n es cero. Hago varios ejemplos del calculo de puntos de acumulación.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Mas vídeos sobre sucesiones==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao95s22dRfaKHaPY_bazObJf', 'aLeAtBwyfWGJyzb9PCIm6gfm_B4', '2012-12-28T22:53:35Z', 18376, 156, 14, 0, 15, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Xe78vH1zWyQ\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Xe78vH1zWyQ'),
('4vU0ThHnBKc', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlhlNzh2SDF6V3lR', 'Video de sucesiones - introducción', 'youtube#playlistItem', 'Es este video explico que es una sucesión, cual es la notación que se usa y explico su definición. También enseño algunos ejemplos de sucesiones.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Mas vídeos sobre sucesiones==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao95s22dRfaKHaPY_bazObJf', 'rcWUC9-ZEHvovZFuV-GNPT2wmDE', '2012-12-28T22:45:52Z', 34546, 192, 5, 0, 13, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/4vU0ThHnBKc\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/4vU0ThHnBKc'),
('vxNx4nASKwU', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjR2VTBUaEhuQktj', 'Video de limites - Continuidad de una función - Continuidad en un punto', 'youtube#playlistItem', 'En este video explico cuando un función es continua en un punto. Explico las tres propiedades que un función tiene que cumplir en un punto para poder decir que es continua en ese punto. También explico cuando decimos que una función es continua en todos los reales. También resuelvo 5 ejemplos donde analizo si un función es continua en toda la recta real.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Lista de reproducción==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao_BCVVIyn5GhX21xSM8GzaU\n\n== Lista de videos de limites ==\n\n1. Video de limites introducción\n    http://www.youtube.com/watch?v=ZKWYkDnmBcE\n\n2. Video de limites - ejemplo numerico y grafico\n   http://www.youtube.com/watch?v=moT8l_yleok\n\n3. Video de limites - ejemplo grafico 2 \n   http://youtu.be/RFq6UEiQ3cU\n\n4. Demostracion del limite del coseno menos 1 sobre x igual a cero (1-cos x)/x \n   http://youtu.be/8pPKysgdcmI\n\n5. Video de límites: limite del seno de x sobre x sen(x)/x \n   http://youtu.be/de3XsF3Ic4g\n\n6. Video de limites - definición formal \n   http://youtu.be/jzc6tzqNOFc\n\n7. Video de limites - definición formal - ejemplo 1 \n   http://youtu.be/pHXOM5xZC5s\n\n8. Video de limites - definición formal-ejemplos 2 y 3 \n   http://youtu.be/hwFpna13oZg\n\n9. Video de limites básicos \n   http://youtu.be/AaHllwCt6FQ\n\n10. Video de limites - Propiedades Básicas \n    http://youtu.be/S2v0VnekVGQ\n\n11. Video de limites - calculando limites - ejemplos \n    http://youtu.be/hw5jIFi2Gv4\n\n12. Video de limites - Continuidad de una función - Continuidad en un punto \n    http://youtu.be/