('SMJDvQN7bcE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnZ4Tng0bkFTS3dV', 'Video de limites laterales - Limite por la derecha - limite por la izquierda', 'youtube#playlistItem', 'En este video explico los limites laterales. Serian el limite por la derecha de una función y el limite por la izquierda de una función. Tambien hago un ejemplo donde explico estos dos limites.\n\nEste video es parte de la clase online de calculo diferencial en nuestra pagina de internet academatica.com Estos cursos online de matemática son gratis.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n==Lista de reproducción==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao_BCVVIyn5GhX21xSM8GzaU\n\n== Lista de videos de limites ==\n\n1. Video de limites introducción\n    http://www.youtube.com/watch?v=ZKWYkDnmBcE\n\n2. Video de limites - ejemplo numerico y grafico\n   http://www.youtube.com/watch?v=moT8l_yleok\n\n3. Video de limites - ejemplo grafico 2 \n   http://youtu.be/RFq6UEiQ3cU\n\n4. Demostracion del limite del coseno menos 1 sobre x igual a cero (1-cos x)/x \n   http://youtu.be/8pPKysgdcmI\n\n5. Video de límites: limite del seno de x sobre x sen(x)/x \n   http://youtu.be/de3XsF3Ic4g\n\n6. Video de limites - definición formal \n   http://youtu.be/jzc6tzqNOFc\n\n7. Video de limites - definición formal - ejemplo 1 \n   http://youtu.be/pHXOM5xZC5s\n\n8. Video de limites - definición formal-ejemplos 2 y 3 \n   http://youtu.be/hwFpna13oZg\n\n9. Video de limites básicos \n   http://youtu.be/AaHllwCt6FQ\n\n10. Video de limites - Propiedades Básicas \n    http://youtu.be/S2v0VnekVGQ\n\n11. Video de limites - calculando limites - ejemplos \n    http://youtu.be/hw5jIFi2Gv4\n\n12. Video de limites - Continuidad de una función - Continuidad en un punto \n    http://youtu.be/vxNx4nASKwU\n\n13. Video de limites laterales - Limite por la derecha - limite por la izquierda \n    http://youtu.be/SMJDvQN7bcE\n\n14. Video de limites - continuidad de una función en un intervalo cerrado \n    http://youtu.be/NQBMvyeJr6U\n\n15. Video de limites - Ejemplo maestro \n    http://youtu.be/l6QYawKqqZ4', 'lEI3T_SlfLi7O-sHFUkJ6pYNW7Q', '2012-12-28T18:47:34Z', 103363, 291, 130, 0, 25, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/SMJDvQN7bcE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/SMJDvQN7bcE'),
('l6QYawKqqZ4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LlNNSkR2UU43YmNF', 'Video de limites - Ejemplo maestro', 'youtube#playlistItem', 'En este video resuelvo un ejercicio de limites donde se pide calcular los limites laterales por la derecha y por la izquierda. También evaluar el limite en un punto y evaluar la función. Tiene el titulo de EJEMPLO MAESTRO por que en este ejercicio hay que aplicar todos los conceptos que se aprendieron en esta serie de video sobre limites.\n\nEste video es parte de la clase online de calculo diferencial en nuestra pagina de internet academatica.com Estos cursos online de matemática son gratis.\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com\n\n==Lista de reproducción==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao_BCVVIyn5GhX21xSM8GzaU\n\n== Lista de videos de limites ==\n\n1. Video de limites introducción\n    http://www.youtube.com/watch?v=ZKWYkDnmBcE\n\n2. Video de limites - ejemplo numerico y grafico\n   http://www.youtube.com/watch?v=moT8l_yleok\n\n3. Video de limites - ejemplo grafico 2 \n   http://youtu.be/RFq6UEiQ3cU\n\n4. Demostracion del limite del coseno menos 1 sobre x igual a cero (1-cos x)/x \n   http://youtu.be/8pPKysgdcmI\n\n5. Video de límites: limite del seno de x sobre x sen(x)/x \n   http://youtu.be/de3XsF3Ic4g\n\n6. Video de limites - definición formal \n   http://youtu.be/jzc6tzqNOFc\n\n7. Video de limites - definición formal - ejemplo 1 \n   http://youtu.be/pHXOM5xZC5s\n\n8. Video de limites - definición formal-ejemplos 2 y 3 \n   http://youtu.be/hwFpna13oZg\n\n9. Video de limites básicos \n   http://youtu.be/AaHllwCt6FQ\n\n10. Video de limites - Propiedades Básicas \n    http://youtu.be/S2v0VnekVGQ\n\n11. Video de limites - calculando limites - ejemplos \n    http://youtu.be/hw5jIFi2Gv