('p3Oa6-xF9N4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjAwTEtoc3J6X25V', 'Video de Diferencial dos variables -Parte 1- Audio Mejorado', 'youtube#playlistItem', 'En este video introduzco que es el diferencial de una función de dos variables. Es una versión nueva de un video que ya había hecho que por alguna razon algunas personas no escuchaban el sonido entonces modifique el sonido para que se oyera mejor.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '--ZoY3gk2ik-LvL_pC3tCFYC1ZI', '2012-12-21T02:49:48Z', 7813, 9, 2, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/p3Oa6-xF9N4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/p3Oa6-xF9N4'),
