('Y_CDKr32Xrs', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkhVazNwN2RtMm5B', 'Video del metodo de fracciones parciales - Paso 4', 'youtube#playlistItem', 'En este video del métodos de fracciones parciales explico el cuarto paso para descomponer una fracción en sumas. También doy un ejemplo de como aplicar este paso.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'bo7oRzjVzhwGyoygiUCjKKfztFg', '2012-12-20T19:16:56Z', 4717, 17, 2, 0, 5, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Y_CDKr32Xrs\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Y_CDKr32Xrs'),
('w4-f-zii5ns', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LllfQ0RLcjMyWHJz', 'Video del metodo de fracciones parciales - Paso 2 y 3.', 'youtube#playlistItem', 'En este video del método de fracciones parciales explico los pasos 2 y 3 del método. También hago un ejemplo de estos dos pasos.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'kgDcZeXJuTHaOrXawv8u5zTAupM', '2012-12-20T18:55:58Z', 7954, 21, 2, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/w4-f-zii5ns\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/w4-f-zii5ns'),
('bU51QbNOh6U', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lnc0LWYtemlpNW5z', 'Video sobre el metodo de descomposición en fracciones parciales - Paso 1', 'youtube#playlistItem', 'En este video tutorial explico el primer paso a tomar en el método de fracciones parciales. Este método lo vamos a usar después para resolver integrales.\n\nSi les gusta denle like y comenten sugerencias de como mejorarlo y simplemente cuentenme si les ha servido .\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '4lgCJa8bOCvkOC07tVAGJus2KL4', '2012-12-20T18:30:54Z', 14701, 32, 10, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/bU51QbNOh6U\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/bU51QbNOh6U'),
('un1pj07tWT4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmJVNTFRYk5PaDZV', 'Video de Integral por fracciones parciales - introducción', 'youtube#playlistItem', 'http://www.wikimatematica.org/index.php?title=Fracciones_parciales\nEn este video o series de videos explico o introduzco el por que es necesario el usar integrales por fracciones parciales para resolver una integral. Empezamos haciendo la integral usando el método de sustitución trigonométrica y nos damos cuenta que hubiera sido mas fácil hacer la integral usando una descomposición en fracciones parciales.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '-5wLwTOPbdMkqR9aTuafxp9n3cg', '2012-12-20T18:08:57Z', 2111, 9, 0, 0, 0, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/un1pj07tWT4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/un1pj07tWT4'),
