('5OFr30Qedos', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjdPRUItVFZOOVBJ', 'Funciones crecientes y decrecientes- Ejemplo 1 - Academatica.com', 'youtube#playlistItem', 'http://bit.ly/funciones-crecientes-decrecientes\nEn este video hago un ejemplo de como encontrar los intervalos donde una función crece y decrece.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '7iqC-nRDWt2xjNUXnFI303wD9Yo', '2012-12-16T05:51:57Z', 63928, 261, 38, 0, 15, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/5OFr30Qedos\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/5OFr30Qedos'),
('gtn22OyQ71I', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjVPRnIzMFFlZG9z', 'Funciones crecientes y decrecientes - Academatica.com', 'youtube#playlistItem', 'http://bit.ly/funciones-crecientes-decrecientes\nEn este video explico que características tiene que cumplir una función para que sea llamada creciendo o decreciente en un intervalo.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', '5Vow4dqBME01AKbE50deH_41zeg', '2012-12-16T05:49:58Z', 31496, 63, 3, 0, 7, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/gtn22OyQ71I\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/gtn22OyQ71I'),
('emjucbFp4mo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lmd0bjIyT3lRNzFJ', 'Gráfica de funciones polinomiales', 'youtube#playlistItem', 'http://bit.ly/Funciones-Polinomiales\nEn este video ya hacemos nuestra gráfica de una función polinomiales encontrando los ceros de la función y revisando el signo de la una función usando una tabla.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'R3m0n0u_vcr5esp2oQ9ugTmTPcY', '2012-12-16T05:46:49Z', 112849, 710, 58, 0, 50, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/emjucbFp4mo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/emjucbFp4mo'),
('cvL5w3lJXoU', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmVtanVjYkZwNG1v', 'Funciones polinomiales - Comportamiento en el infinito', 'youtube#playlistItem', 'http://bit.ly/Funciones-Polinomiales\nEn este video explico como la paridad del grado y el signo del coeficiente principal afecta el comportamiento cuando x tiende al infinito y menos infinito.\nYa es el inicio para poder hacer la gráfica.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'AGtS8evM57KW4-fxnmDEQyIKFjU', '2012-12-15T22:23:08Z', 7337, 68, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cvL5w3lJXoU\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/cvL5w3lJXoU'),
('yvlYKZuI9W4', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmN2TDV3M2xKWG9V', 'Funcion polinomial de tercer grado', 'youtube#playlistItem', 'http://bit.ly/Funciones-Polinomiales\nExplico como es la gráfica de una función polinomial de 3 grado.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'DCXSiEl6T1HKrfkf0krTnZRA_TE', '2012-12-15T22:15:18Z', 29395, 50, 10, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/yvlYKZuI9W4\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/yvlYKZuI9W4'),
('eXhPtQGXlIg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lnl2bFlLWnVJOVc0', 'Funciones polinomiales. Introducción', 'youtube#playlistItem', 'http://bit.ly/Funciones-Polinomiales\nIntroducción a que es una función polinomial y cuales ya hemos estudiado. Función constante, lineal y cuadratica.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'csF2FZgL8OWJclhRd7vvPpPMneE', '2012-12-15T22:08:23Z', 18642, 17, 4, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/eXhPtQGXlIg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/eXhPtQGXlIg'),
('5LI3j9VqMLk', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmVYaFB0UUdYbEln', 'Introducción a circuitos electricos. Resistencia, Corriente, Voltaje. Ley de Ohm.', 'youtube#playlistItem', '➤ Siguiente video: http://youtu.be/LaUDvoZa9ko LEY DE OHM\nEn este video explico la analogía sencilla entre la corriente eléctrica y el flujo de agua. Es una introducción al concepto de circuito eléctrico y da un panorama general de que es voltaje, que es resistencia y que es corriente alterna. Esta pensado para cualquier tipo de persona que desee entender que es un circuito eléctrico y como funcione. También se habla un poco sobre la ley de Ohm.\n\n==Lista de video de electricidad==\nhttp://www.youtube.com/playlist?list=PLAFn9q_BCao9lFGiOljMEUrClm4f_dAbC\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\nhttp://www.facebook.com/academatica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'rC9gkgiiX29_O2Tvrc-lbCs-7yM', '2012-12-15T22:01:41Z', 282344, 1875, 172, 0, 142, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/5LI3j9VqMLk\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/5LI3j9VqMLk'),
