('bSRg6G6wik8', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkFZVHdfUmRUdWVj', 'Sustitución Trigonometrica. (Ejemplo #5) Version 2012', 'youtube#playlistItem', 'Quinto ejemplo de integrales por sustitución trigonométrica. Este ejemplo es para cuando tenemos que complementar al cuadrado antes de hacer la sustitución del triangulito.', 'VYYI5jDQx7t4zgeGUABDZbGr4uU', '2012-10-20T18:06:05Z', 2794, 17, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/bSRg6G6wik8\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/bSRg6G6wik8'),
