('jSTodkiEoWg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkhLck9sa1JQYktJ', 'Sustitución Trigonometrica. (Ejemplo #1) Version 2012', 'youtube#playlistItem', 'Primer ejemplo de integrales por sustitución trigonométrica. Este ejemplo es para el caso x^2+a^2. Caso 1.', 'Tz82WOoMAXUxvekmhv8kS5Q6RLc', '2012-09-03T02:49:26Z', 7504, 54, 4, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/jSTodkiEoWg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/jSTodkiEoWg'),
('NHA-mhsQTTg', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmpTVG9ka2lFb1dn', 'Sustitución trigonometrica (Identificación de los casos)', 'youtube#playlistItem', 'En este video se explica como identificar si una integral se debe resolver usando la técnica de sustitución trigonométrica. Se explica cada uno de los casos que se pueden dar.', 'pBNYE1GfDmw6N4dGMAzRZaTaVc8', '2012-09-03T02:48:03Z', 12567, 138, 6, 0, 11, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/NHA-mhsQTTg\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/NHA-mhsQTTg'),
('mUgjhT8l3A0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk5IQS1taHNRVFRn', 'Solución del ejercicio dejado en el video de intro a las sustitución trigonométrica', 'youtube#playlistItem', 'En este video se la la solución del ejercicio dejado en el video de introducción a las integrales por sustitución trigonométrica.\n\nhttp://youtu.be/A4buzY72xio  Este es el video', 'Zy7LEK-KlWyHC51OVRegH-iti6k', '2012-09-03T02:44:37Z', 1622, 8, 1, 0, 1, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/mUgjhT8l3A0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/mUgjhT8l3A0'),
('A4buzY72xio', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lm1VZ2poVDhsM0Ew', 'Ejercicio Introductorio a las Integrales por Sustitución Trigonométrica', 'youtube#playlistItem', 'En este ejercicio introducimos la técnica de integración por sustitución Trigonométrica.', 'y3Ut0_HCwfEXJG6bUePOKzqO7E8', '2012-09-03T02:42:23Z', 9099, 22, 4, 0, 2, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/A4buzY72xio\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/A4buzY72xio'),
('Ans9yM9xKL0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkE0YnV6WTcyeGlv', 'Circuitos RC y RL - Aplicaciones Ecuaciones Diferenciales de primer Orden', 'youtube#playlistItem', 'Visita: http://bit.ly/Modelos-lineales FB: http://bit.ly/academatica\nEn este video explico como plantear la ecuación diferencial para los circuitos RL y RC. También hago un ejemplo de como resolver un circuito RL.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'ia-_tdeej0A3BVSqhNrI2ESeRgs', '2012-09-03T02:39:25Z', 197157, 1087, 93, 0, 88, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Ans9yM9xKL0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Ans9yM9xKL0'),
('zSVZddalAcY', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkFuczl5TTl4S0ww', 'Datación por radiocarbono - Aplicaciones de la ecuaciones diferenciales de primer orden', 'youtube#playlistItem', 'Visita: http://bit.ly/Modelos-lineales FB: http://bit.ly/academatica\nSeguimos con las aplicaciones de la ecuaciones diferenciales. En este video explicamos la datación por radio carbono con dos ejemplos.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'yxNPHMkx0bRDhKAcCyyB_yVK4mw', '2012-08-18T17:45:40Z', 13998, 133, 1, 0, 20, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/zSVZddalAcY\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/zSVZddalAcY'),
('O_uHfPWEL74', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnpTVlpkZGFsQWNZ', 'Ecuaciones Diferenciales de primer orden - Aplicaciones - Periodo Medio - Desintegración', 'youtube#playlistItem', 'Visita: http://bit.ly/Modelos-lineales FB: http://bit.ly/academatica\nPeriodo medio, aplicación de las ecuaciones diferenciales de primer orden. El periodo medio es una medida de la estabilidad de una sustancia radioactiva. El tiempo que transcurre para que se desintegre ó transmute la mitad de los átomos de una muestra inicial.\n\nSe dan dos ejemplo de este tema.\n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'f1ybG5Wz6HvW0pkONH7OTeZ8BZY', '2012-08-15T02:10:45Z', 19872, 92, 8, 0, 15, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/O_uHfPWEL74\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/O_uHfPWEL74'),
('CK8AuVOlOL0', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lk9fdUhmUFdFTDc0', 'Regresión Lineal Bivariada - Cuadrados Minimos - Demostración', 'youtube#playlistItem', 'Es este video se dan las demostraciones de los estimadores de mínimos cuadrados para la regresión lineal de dos variables. No hay ningún ejemplos pues la idea es solo demostrar como son las formulas para estos estimados. Empiezo definiendo que es lo que se quiere lograr y después minimizamos la suma de los errores al cuadrado.\n\nSuscríbanse y comenten.  \n\n===Suscribete a nuestro canal en youtube===\nhttp://www.youtube.com/chzelada\n\n===Siguenos en Facebook===\nhttp://www.facebook.com/wikimatematica\n\n===Visitas nuestros sitios===\nhttp://www.wikimatematica.org\nhttp://www.academatica.com', 'dosBLGb7p5iePxkRP0wLxFv5KSU', '2012-08-11T17:46:30Z', 37510, 330, 12, 0, 45, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/CK8AuVOlOL0\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/CK8AuVOlOL0'),
('a82-aYiyOHQ', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkNLOEF1Vk9sT0ww', 'Integrales Triples Sobre Regiones Generales (Parte 2)', 'youtube#playlistItem', 'En este ejemplo desarrollo el ejemplo 2 de integrales triples sobre regiones generales.\nVersión reciente en HD $9 con este cupón https://www.udemy.com/integrales-multiples/?couponCode=YTcan­al\nTeoría en http://www.wikimatematica.org\nVideos en http://www.academatica.com', 'Wfw7Y3FLXYMFPlFmkxlW7xlqk4w', '2012-07-29T17:08:14Z', 25062, 124, 24, 0, 22, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/a82-aYiyOHQ\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/a82-aYiyOHQ');
INSERT INTO `videos` (`video_id`, `id`, `title`, `kind`, `description`, `etag`, `published_at`, `views`, `likes`, `dislikes`, `favorites`, `comments`, `iframe`, `link`) VALUES
('sfJtriQtHaI', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmE4Mi1hWWl5T0hR', 'Integrales Triples Sobre Regiones Generales (Parte 1)', 'youtube#playlistItem', 'En este video explico como calcular una integral triple sobre diferentes tipos de superficies. Son 3 tipos con los que trabaje y se hizo un ejemplo en la primera parte y otro en la segunda parte.\n\nVersión reciente en HD $9 con este cupón https://www.udemy.com/integrales-multiples/?couponCode=YTcanal\n\nTeoría en http://www.wikimatematica.org\nVideos en http://www.academatica.com', 'zL_iX62XN5kMADX6sS-0fJae1WQ', '2012-07-21T22:41:59Z', 87989, 434, 38, 0, 46, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/sfJtriQtHaI\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/sfJtriQtHaI'),
('EuBIuLXkglQ', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnNmSnRyaVF0SGFJ', 'Integrales Triples Sobre Cajas', 'youtube#playlistItem', 'En este video se explica de donde vienen las integrales triples y se demuestran a partir de una caja rectangular. También hay un ejemplo de como calcular estas integrales.\nVersión reciente en HD $9 con este cupón https://www.udemy.com/integrales-multiples/?couponCode=YTcan­al\n\nTeoría en http://www.wikimatematica.org\nVideos en http://www.academatica.com', 'dHfjzl71alBLcnW6z8fF2SykY6s', '2012-07-21T22:33:45Z', 16864, 105, 8, 0, 8, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/EuBIuLXkglQ\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/EuBIuLXkglQ'),
('2nWSW3SA-no', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LkV1Qkl1TFhrZ2xR', 'Crecimiento Poblacional. (Aplicaciones Ecuaciones diferenciales de primer orden)', 'youtube#playlistItem', 'Visita: http://bit.ly/Modelos-lineales FB: http://bit.ly/academatica\nEn este video trabajamos el crecimiento poblacional y hago una introduccion de algunas aplicaciones que voy a trabajar de ecuaciones diferenciales de primer orden.', 'mX3g-68C1CFU5Qo0JKuSTYJzUZg', '2012-07-21T22:20:52Z', 218329, 878, 79, 0, 112, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/2nWSW3SA-no\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/2nWSW3SA-no'),
('lekw3MgIr20', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LjJuV1NXM1NBLW5v', 'Ecuaciones Diferenciales de Bernoulli. (Ejemplo #3)', 'youtube#playlistItem', 'http://bit.ly/Ec-Diff-Bernoulli\nTercer ejemplo de solución de una ecuación diferencial de Bernoulli.\n\nhttp://www.academatica.com\nhttp://www.wikimatematica.com', '7DxJ8YE86iUFAjy1afjMcBG0E9Q', '2012-06-07T18:26:48Z', 16124, 42, 3, 0, 5, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/lekw3MgIr20\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/lekw3MgIr20'),
('JzIV7PMX004', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lmxla3czTWdJcjIw', 'Ecuaciones Diferenciales de Bernoulli. (Ejemplo #2)', 'youtube#playlistItem', 'http://bit.ly/Ec-Diff-Bernoulli\nSegundo ejemplo de solución de una ecuación diferencial de Bernoulli.\n\nhttp://www.academatica.com\nhttp://www.wikimatematica.com', 'lD3816lafkcrKF1AguH6SIyB55A', '2012-05-02T04:39:42Z', 19984, 54, 8, 0, 11, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/JzIV7PMX004\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/JzIV7PMX004'),
('yK3bUDeDKqY', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3Lkp6SVY3UE1YMDA0', 'Ecuaciones Diferenciales de Bernoulli', 'youtube#playlistItem', 'http://bit.ly/Ec-Diff-Bernoulli\nEn este video explico las caracteristicas que tiene que cumplir una ecuación diferencial para poder ser llamada de Bernoulli. Ademas Hago un ejemplo de como resolver este tipo de ecuaciones diferenciales.\n\nhttp://www.academatica.com\nhttp://www.wikimatematica.com', 'HwgN_cXPEKh7ttS_6gHKjqHvPbo', '2012-05-02T04:23:40Z', 37312, 66, 23, 0, 20, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/yK3bUDeDKqY\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/yK3bUDeDKqY'),
