('hBrnLlouwes', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmxxSC1aeUtQMXVR', 'Integrales Trigonométricas. (Parte 1)', 'youtube#playlistItem', 'Visita: http://bit.ly/P3hY1c FB: http://bit.ly/academatica\nEn este video explico como resolver integrales que contiene senos y cosenos llamadas también integrales trigonométricas. Hago varios ejemplos de esta tecnica.\n\nhttp://www.wikimatematica.org/\nhttp://bit.ly/P3hY1c - Integrales trigonométrica en wikimatematica. Ejercicios resueltos\n\nPuedes ver mas vídeos en http://www.academatica.com', 'ZIGqKHscn3lDrrHLQafa7IL2qTQ', '2011-04-26T22:19:23Z', 145482, 224, 29, 0, 41, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/hBrnLlouwes\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/hBrnLlouwes'),
