('haBLD96vlE8', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmxPcTVkUkRGV05J', 'Transformada de Laplace 3/6 (Transformada de una constante, exponencial y corrimiento)', 'youtube#playlistItem', 'Primer ejemplo de mis serie de videos de transformada de Laplace. Aquí hago la transformada de una constante y la transformada de la función exponencial. También demuestro el corrimiento en la frecuencia o llamado también el primer teorema de translación.\nPara los videos en orden ver,\nhttp://www.academatica.com\n\nEjemplos de la transformada de Laplace. Ejemplo #1 transformada de la funcion constante. Ejemplo #2 transfomadad de e^{at} y a la vez demostración del primer teorema de traslación.', 'k-ABgoY5_waUS9of67W04X_BnOw', '2010-06-02T22:24:53Z', 44997, 152, 2, 0, 13, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/haBLD96vlE8\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/haBLD96vlE8'),
('p45b0I-7NYA', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LmhhQkxEOTZ2bEU4', 'Transformada de Laplace 2/6', 'youtube#playlistItem', 'En este video continuo con la demostración del origen de la transformada de Laplace y empiezo a hablar de algunas propiedades de esta transformación\n\nPara los videos en orden ver,\nhttp://www.academatica.com\nIntroducción a la la transformada de Laplace.', 't78MP4nYqRzNnlyd1lViuvVH9Ac', '2010-06-02T17:53:52Z', 55466, 266, 5, 0, 33, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/p45b0I-7NYA\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/p45b0I-7NYA'),
('wNu80ZvG2JE', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LnA0NWIwSS03TllB', 'Transformada de Laplace 1/6 (De donde viene la transformada de Laplace)', 'youtube#playlistItem', 'Visita: http://bit.ly/t-laplace FB: http://bit.ly/academatica\nEn este video explico de donde viene la transformada de Laplace. Explico como es un caso continuo de las serie de Taylor. Es una introducción poco común que da un buen panorama de que es la transformada de Laplace.\n\nCurso de Laplace en linea 50% de descuento\nhttps://www.udemy.com/transformada-de-laplace/?couponCode=academaticaB\n\nhttp://www.wikimatematica.org/index.php?title=Definici%C3%B3n_de_transformada_de_Laplace.\nPara los videos en orden ver,\nhttp://www.academatica.com\n\nIntroducción a la la transformada de laplace. Pueden ver el contenido que esta en este video aqui http://www.wikimatematica.org/index.php?title=Definici%C3%B3n_de_transformada_de_Laplace.\n\nhttp://www.wikimatematica.org', 'oXm3HcM5y5i3bDdLAIvy_PmgzFs', '2010-06-02T15:25:04Z', 181864, 503, 25, 0, 59, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/wNu80ZvG2JE\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/wNu80ZvG2JE'),
('Q7dClG5_xyo', 'VVUyRW5JX0kyX1NEcFRfV1lYRXNsVWl3LndOdTgwWnZHMkpF', 'Distancia entre puntos en 3D', 'youtube#playlistItem', NULL, 'SrdyReHZOxw_dTeC1bO2t__SWeQ', '2010-06-02T15:23:23Z', 92370, 441, 46, 0, 32, '\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Q7dClG5_xyo\" \nframeborder=\"0\" allow=\"accelerometer; autoplay; \nencrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\n', 'https://youtu.be/Q7dClG5_xyo'),
